 e.e.a mbt de activiteiten die er zijn, waar je aan kan deelnemen, of zelf kan organiseren.\n-Je schrijft je gratis in.\n-Je krijgt dan een mail met een dankjewel voor de inschrijving, je inschrijving gaat in review.\n-Binnen 48 uur krijg je bericht via de e-mail, met approved/ of anders; en dan kom je op een wachtlijst.\n-Als je je hebt ingeschreven en je bent gemaild binnen 48 uur met approved, ben je lid.\n-Je kan dan meedoen met activiteiten.\n-Dan pas krijg je de betaalpagina, per maand kwartaal of jaar.','[]','2020-04-11 16:44:28','2020-04-11 16:45:25',0,0,0,'everyone'),(109,'friends','user',1,'user',9,'{item:$object} is now friends with {item:$subject}.','[]','2020-04-13 13:23:15','2020-04-13 13:23:15',0,0,0,NULL),(110,'friends','user',9,'user',1,'{item:$object} is now friends with {item:$subject}.','[]','2020-04-13 13:23:15','2020-04-13 13:23:15',0,0,0,NULL),(122,'sesevent_create','user',1,'sesevent_event',15,'','[]','2020-04-16 16:42:06','2020-04-16 16:42:06',1,0,0,NULL),(123,'share','user',1,'user',1,'','{\"type\":\"<a href=\\\"\\/event\\/bbq\\\">event<\\/a>\"}','2020-04-16 16:42:22','2020-04-16 16:42:22',1,0,0,NULL),(124,'sesevent_event_createticket','user',1,'sesevent_event',15,'','{\"ticketName\":\"<b>Bbq<\\/b>\"}','2020-04-16 16:51:09','2020-04-16 16:51:09',0,0,0,NULL),(125,'sesevent_join','user',5,'sesevent_event',15,'','[]','2020-04-16 17:05:33','2020-04-16 17:05:33',0,0,0,NULL),(126,'sesevent_event_createticket','user',1,'sesevent_event',15,'','{\"ticketName\":\"<b>bbq<\\/b>\"}','2020-04-16 17:12:45','2020-04-16 17:12:45',0,0,0,NULL),(127,'sesevent_event_editticketdate','user',1,'sesevent_event',15,'','{\"editDateFormat\":\"From <b>Apr 15, 2020 10:30 PM<\\/b> To <b>Apr 16, 2020 09:30 PM<\\/b> (Europe\\/Berlin)\",\"ticketName\":\"<b>bbq<\\/b>\"}','2020-04-16 17:15:34','2020-04-16 17:15:34',0,0,0,NULL),(128,'sesevent_create','user',1,'sesevent_event',16,'','[]','2020-04-21 11:04:00','2020-04-21 11:04:00',1,0,0,NULL),(129,'sesevent_join','user',9,'sese