INSERT INTO `engine4_core_banners` VALUES (1,'user','user','Connect with People','The world is a book. Those who do not connect with others miss many pages.',803,'{\"label\":\"Invite\",\"route\":\"default\",\"routeParams\":{\"module\":\"invite\"}}',0),(2,'group','group','Get Together ','Create and join interest based Groups. Bring people together.',758,'{\"label\":\"Create New Group\",\"route\":\"group_general\",\"routeParams\":{\"action\":\"create\"}}',0),(3,'album','album','Explore. Create. Inspire','Share your passion to capture the world. Find inspiration in breathtaking Photos.',1,'{\"label\":\"Add New Photos\",\"route\":\"album_general\",\"routeParams\":{\"action\":\"upload\"}}',0),(4,'album','album','Explore. Create. Inspire','Share your passion to capture the world. Find inspiration in breathtaking Photos.',0,'{\"label\":\"Add New Photos\",\"route\":\"album_general\",\"routeParams\":{\"action\":\"upload\"}}',0),(10,'custom_10','core','    dan+doen+we+dat','Nieuwe mensen ontmoeten + Nieuwe dingen Beleven',817,'{\"label\":\"Lid worden.\",\"uri\":\"https:\\/\\/dandoenwedat.com\\/signup\"}',1),(11,'custom_11','core','- Our Mission -','Een vrolijkheidsuiting door middel van het optrekken van de mondhoeken en vaak het voortbrengen van een geluid.',818,'{\"label\":\"\",\"uri\":\"\"}',1),(12,'custom_12','core','dan+doen+we+dat','dan+doen+we+dat  is de Sociale Ontmoetingsplek voor ondernemende mensen in Nederland. Leden en Crew organiseren kleinschalige events waar mensen elkaar in real life ontmoeten. Door heel Nederland en ook daarbuiten. ',820,'{\"label\":\"\",\"uri\":\"\"}',1),(13,'custom_13','core','dan+doen+we+dat','Een nieuwe stad, een nieuwe baan of op zoek naar leuke activiteiten + events? Je ontmoet altijd nieuwe mensen van jouw leeftijd en met dezelfde interesses bij jou in de buurt.',826,'{\"label\":\"\",\"uri\":\"\"}',1),(14,'custom_14','core','dan+doen+we+dat ','Binnen no-time zet je je eigen events op! Er zijn altijd mensen met dezelfde interesses. dan+doen+we+dat is voor mensen met sociale vaardigheden. Sociaal, Communicatief, Open, Nieuwsgierig en Pro-Actief.\r\n\r\ndan+doen+we+dat staat voor Ontdekken + Beleven.\r',825,'{\"label\":\"\",\"uri\":\"\"}',1),(15,'custom_15','core','dan+doen+we+dat','Ben je Sportief, of hou je van een feestje. Een picknick in het park met mooi weer. Ga je graag de natuur in. dan+doen+we+dat geeft je de mogelijkheid om het allemaal te Beleven + Ontdekken. ',822,'{\"label\":\"\",\"uri\":\"\"}',1),(16,'custom_16','core','dan+doen+we+dat','Wij houden ervan om interessante mensen te ontmoeten, en om leuke activiteiten te organiseren. Als jij ook nieuwe ervaringen wil beleven en  interessante mensen bij jou in de buurt wilt ontmoeten. \r\n\r\n\r\ndan+doen+we+dat!',821,'{\"label\":\"\",\"uri\":\"\"}',1),(17,'custom_17','core','Spelregeltjes','Event-Regulations',889,'{\"label\":\"New Event\",\"uri\":\"https:\\/\\/dandoenwedat.com\\/events\\/create\"}',1),(18,'custom_18','core','Helemaal gratis! Nú voor het hele jaar.','',890,'{\"label\":\"\",\"uri\":\"\"}',1),(19,'custom_19','core','€36 voor het hele jaar. Daarna €2.99 p/m.','Of €5 p/m maandelijks opzegbaar.',900,'{\"label\":\"membership\",\"uri\":\"https:\\/\\/dandoenwedat.com\\/signup\"}',1),(20,'custom_20','core','€2.99 p/m','€36 per jaar. Of €5 p/m maandelijks opzegbaar.',894,'{\"label\":\"\",\"uri\":\"\"}',1);
