\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">ARTIKEL 1.&nbsp;<\\/span><span class=\\\"s3\\\">DEFINITIES<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p5\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Voor zover uit de aard of strekking daarvan niet anders voortvloeit, worden de volgende termen in deze algemene voorwaarden, in de navolgende betekenis gebruikt.<\\/span><\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">dan+doen+we+dat: de gebruiker van deze algemene voorwaarden, gevestigd te Amsterdam, ingeschreven in het Handelsregister onder KvK-nummer &mdash;&mdash;&mdash;&mdash;<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat-lid: de natuurlijke persoon die zich middels de website heeft geregistreerd en daarmee in staat wordt gesteld van de diensten van dan+doen+we+dat gebruik te maken.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Host\\/ Organisator: de feitelijke Host\\/ Organisator van het product, de dienst, de activiteit\\/ event of het arrangement, welk product, welke dienst of arrangement op de website wordt aangeboden.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Activiteit\\/ Event:<br>Een enkel- of meervoudige actieve bezigheid die op de dan+doen+we+dat-website voor lid van dan+doen+we+dat vrijblijvend worden opgezet om te ondernemen, en met als doel om op een actieve en ontspannen&nbsp;manier deel te nemen aan activiteiten en events. Daaronder&nbsp;vallen onder meer feest- en uitgaansactiviteiten, sportieve en avontuurlijke events, kunst en cultuur, body&nbsp;en mind, persoonlijke ontwikkeling, andere diensten of faciliteiten en\\/of het gebruik van materialen,&nbsp;maaltijden en drank met dag- en\\/of nachtverblijf in binnen- of buitenland. Vervoer van en naar de plaats&nbsp;van event valt daar nooit onder.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Website: www.dandoenwedat.com<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 2.&nbsp;<\\/span><span class=\\\"s1\\\">ALGEMENE BEPALINGEN<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Deze algemene voorwaarden zijn van toepassing op alle activiteiten\\/ evenementen, transacties, overeenkomsten en andere rechtshandelingen die middels de website door de dan+doen+we+dat-lid met Dan+doen+we+dat worden aangegaan.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Bij registratie als bedoeld in het volgende artikel verklaart de dan+doen+we+dat-lid met de toepasselijkheid van de onderhavige voorwaarden in te stemmen, waarna deze voorwaarden stilzwijgend van toepassing zijn op de in het vorige lid bedoelde activiteit\\/ evenementen, transacties, overeenkomsten en andere rechtshandelingen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Van deze algemene voorwaarden kan uitsluitend uitdrukkelijk en schriftelijk worden afgeweken. Hetgeen partijen uitdrukkelijk schriftelijk zijn overeengekomen, prevaleert in geval van strijdigheid, boven het bepaalde in deze algemene voorwaarden.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">De toepasselijkheid van de algemene of andersluidende voorwaarden van de dan+doen+we+dat-lid wordt uitdrukkelijk van de hand gewezen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Vernietiging of nietigheid van &eacute;&eacute;n of meer der onderhavige bepalingen laat de geldigheid van de overige bedingen onverlet. In een voorkomend geval zijn partijen verplicht in onderling overleg te treden teneinde een vervangende regeling te treffen ten aanzien van het aangetaste beding. Daarbij wordt zoveel mogelijk het doel en de strekking van de oorspronkelijke bepaling in acht genomen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">dan+doen+we+dat behoudt zich het recht voor zonder voorafgaande aankondiging tarieven of inschrijvingsvereisten te&nbsp;wijzigen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Na aanmelding kan dan+doen+we+dat je zonder opgave van redenen weigeren het dan+doen+we+dat-lidmaatschap te verlenen. dan+doen+we+dat kan je op elk moment verzoeken om een identificatiebewijs te tonen. Indien je&nbsp;daaraan niet voldoet, heeft dan+doen+we+dat het recht zonder restitutie van gelden de toegang tot een event te weigeren en&nbsp;het dan+doen+we+dat-lidmaatschap te be&euml;indigen.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 3.&nbsp;<\\/span><span class=\\\"s1\\\">REGISTREREN EN BEVEILIGING<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Voor gebruikmaking van de diensten van Dan+doen+we+dat, dient de dan+doen+we+dat-lid zich op de website te registreren. De dan+doen+we+dat-lid is gehouden alle bij de registratie gevraagde gegevens volledig en naar waarheid te verstrekken. Registratie is uitsluitend toegestaan voor personen die de leeftijd van 18 jaren hebben bereikt. Dan+doen+we+dat draagt nimmer enige aansprakelijkheid voor schade die is ontstaan als gevolg van door de dan+doen+we+dat-lid onjuist of onvolledig verstrekte gegevens.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat bevestigt de registratie van de dan+doen+we+dat-lid langs elektronische weg. Na ontvangst van deze bevestiging is de dan+doen+we+dat-lid in staat middels haar inloggegevens van de diensten van Dan+doen+we+dat gebruik te maken.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Inloggegevens zijn strikt vertrouwelijk en persoonsgebonden. Het is de dan+doen+we+dat-lid niet toegestaan haar inloggegevens ter beschikking van derden te stellen. Alle handelingen die onder de account van de dan+doen+we+dat-lid worden verricht, worden de geregistreerde dan+doen+we+dat-lid toegerekend. Voor schade als gevolg van onbevoegd gebruik van inloggegevens door derden, draagt Dan+doen+we+dat nimmer enige aansprakelijkheid.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">In geval zich ten aanzien van de door de dan+doen+we+dat-lid bij de registratie opgegeven gegevens wijzigingen voordoen, is de dan+doen+we+dat-lid gehouden deze gegevens zo spoedig mogelijk onder haar account op de website te wijzigingen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">De dan+doen+we+dat-lid is te allen tijde in staat haar registratie ongedaan te maken op de daartoe op de website voorgeschreven wijze. Een dergelijke ongedaanmaking laat de verplichting tot nakoming van eventuele verbintenissen die de dan+doen+we+dat-lid is aangegaan voordat de registratie is ongedaan gemaakt, onverlet, evenals de toepasselijkheid van de bepalingen in deze algemene voorwaarden die naar hun aard of strekking ook na be&euml;indiging van de registratie van kracht blijven.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">De dan+doen+we+dat-lid is gehouden om de apparatuur waarmee de dan+doen+we+dat-lid zichzelf toegang verschaft tot de website afdoende en volgens gebruikelijke maatstaven te beveiligen tegen virussen, andere schadelijke componenten en onrechtmatige programma&rsquo;s en bestanden die zich kunnen verspreiden via het internet. Voorts dient dan+doen+we+dat-lid voldoende (beveiligings-) maatregelen te nemen om gebruik van haar inloggegevens door derden tegen te gaan.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 4.&nbsp;<\\/span><span class=\\\"s1\\\">AANBOD VAN ACTIVITEITEN EN EVENTS<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Zowel Dan+doen+we+dat als de Host\\/ Organisator zijn niet gebonden aan een aanbod van activiteit\\/ evenementen op de website dat een kennelijke fout of vergissing bevat.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Om van het aanbod van activiteit\\/ evenementen op de website gebruik te maken dient de dan+doen+we+dat-lid middels haar inloggegevens op de website in te loggen. De dan+doen+we+dat-lid staat er voor in dat zij volgens de wet gerechtigd is juridisch bindende overeenkomsten te sluiten. De dan+doen+we+dat-lid kan niet van het aanbod van producten en diensten gebruik maken in geval zij krachtens deze algemene voorwaarden tijdelijk of blijvend van deelname is uitgesloten.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Ten aanzien van activiteit\\/ evenementen die nog niet zijn gestart is de Host\\/ Organisator gerechtigd wijzigingen in het aanbod van de activiteit\\/ event&nbsp; aan te brengen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Elk aanbod van activiteit\\/ evenementen geschiedt onder voorbehoud van voldoende beschikbaarheid daarvan. De Host\\/ Organisator is niet gehouden tot levering van activiteit\\/ event over te gaan in geval deze niet leverbaar of beschikbaar zijn.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">In geval van discrepantie tussen mededelingen omtrent het aanbod van activiteit\\/ evenementen enerzijds en de mededelingen daaromtrent van de Host\\/ Organisators anderzijds, zijn de mededelingen van dan+doen+we+dat leidend.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Je kunt als lid van dan+doen+we+dat events voor deelname opzetten voor andere leden van dan+doen+we+dat. Deelname aan events opgezet door lid van dan+doen+we+dat is geheel vrijblijvend. Deelname vindt plaats door aanmelding via de dan+doen+we+dat-website. Het opzetten van&nbsp;commerci&euml;le events is niet toegestaan. Commerci&euml;le events zijn events die voor de organiserende lid van dan+doen+we+dat&nbsp;resulteren in financieel of ander gewin, een en ander naar uitsluitend oordeel van dan+doen+we+dat.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Aan de events kunnen beperkingen of voorwaarden worden verbonden (door bijvoorbeeld een leeftijdseis te&nbsp;stellen. Aan de omschrijving of de schatting van kosten kunnen geen rechten jegens dan+doen+we+dat worden ontleend. Bij&nbsp;het opzetten van events ben je verplicht je te houden aan de spelregels. Deze&nbsp;spelregels&nbsp;staan ook bij:&nbsp;<a title=\\\"event-regulations\\\" href=\\\"https:\\/\\/dandoenwedat.com\\/pages\\/event-regulations\\\">Spelregels Organisator\\/ Host.<\\/a><\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 5.&nbsp;<\\/span><span class=\\\"s1\\\">ETHIEK EN GEDRAGSNORMEN<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">De dan+doen+we+dat-lid is zich ervan bewust dat het plaatsen van berichten met een negatieve, beledigende, bedreigende, grove, obscene of wederrechtelijke aard of inslag, niet is toegestaan.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">De dan+doen+we+dat-lid is zich ervan bewust dat zonder expliciete toestemming van dan+doen+we+dat, het niet is toegestaan om reclame te maken voor andere producten, diensten of andere commerci&euml;le activiteit\\/ evenementen en doelen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Niet nakoming of een handelen of nalaten in strijd met voorafgaande leden staat op straffe van onmiddellijke be&euml;indiging van het lidmaatschap, zonder dat een recht op restitutie van betaalde gelden bestaat. Dit laat onverlet het recht van dan+doen+we+dat op volledige schadevergoeding bij ontstane schade.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 6.&nbsp;<\\/span><span class=\\\"s1\\\">UITSLUITING VAN DEELNAME EN VERBODSBEPALING<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">dan+doen+we+dat behoudt zich het recht voor je lidmaatschap op elk moment te be&euml;indigen en van deelname aan activiteit\\/ evenementen uit te sluiten, indien je gedrag, lichamelijke of geestelijke beperkingen of een andere omstandigheid daartoe aanleiding geeft. Dan+doen+we+dat is daartoe echter op geen enkele wijze verplicht, noch verantwoordelijk. dan+doen+we+dat is dan niet gehouden tot restitutie van gelden en heeft onverminderd het recht op volledige schadevergoeding bij eventueel ontstane schade.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">dan+doen+we+dat behoudt zich het recht voor om door jouw gepubliceerde berichten aan te passen of geheel of gedeeltelijk te verwijderen indien dit passend of noodzakelijk wordt geacht.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat-lid is jegens dan+doen+we+dat aansprakelijk voor schade of enig ander nadeel dat wordt veroorzaakt door het doen of nalaten van jezelf, of door jou toegelaten introduc&eacute;s of derden. Dan+doen+we+dat-lid vrijwaart dan+doen+we+dat volledig van aanspraken van anderen.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 7.&nbsp;<\\/span><span class=\\\"s1\\\">BETALINGSVOORWAARDEN<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Bij betaling aan Dan+doen+we+dat heeft dan+doen+we+dat-lid de mogelijkheid te betalen met (iDeal), PayPal.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Tenzij in de bevestigingsmail uitdrukkelijk anders is vermeld, is de dan+doen+we+dat-lid de door haar verschuldigde betalingen in verband met de transactie aan Dan+doen+we+dat verschuldigd.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Om de dienst of activiteit\\/ event op te eisen dient de dan+doen+we+dat-lid binnen 24 uur na totstandkoming van de betreffende transactie aan haar betalingsverplichting te voldoen. Betalingen dienen plaats te vinden op de wijze en in de valuta zoals door Dan+doen+we+dat in de bevestigingsmail is aangegeven.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Indien geen of niet-tijdige betaling plaatsvindt, is Dan+doen+we+dat gerechtigd de transactie te annuleren en de activiteit\\/ evenementen of diensten niet langer voor de dan+doen+we+dat-lid gereserveerd te (doen) houden.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 8.&nbsp;<\\/span><span class=\\\"s1\\\">AANSPRAKELIJKHEID<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat is nimmer aansprakelijk voor vermissing, verduistering of diefstal of schade, direct of indirect van of aan goederen van de dan+doen+we+dat-lid.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat selecteert Leden\\/ Host\\/ Organisators met de grootst mogelijke zorgvuldigheid. Dan+doen+we+dat staat echter niet in voor de kwaliteit van de door derden geleverde diensten en activiteit\\/ evenementen. Uitsluitend de betreffende Host\\/ Organisator draagt daarvoor de aansprakelijkheid. De dan+doen+we+dat-lid vrijwaart Dan+doen+we+dat van al haar aanspraken en aanspraken van derden ter zake.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat draagt nimmer enige aansprakelijkheid voor schade als gevolg van een omstandigheid die niet aan hem kan worden toegerekend, zoals, maar niet beperkt tot overmacht.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat draagt nimmer enige aansprakelijkheid voor schade ontstaan doordat hij is uitgegaan van door de dan+doen+we+dat-lid onjuist of onvolledig verstrekte gegevens.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat is niet aansprakelijk voor schade in verband met technische storingen van de website of andere toegankelijkheidsproblemen ten aanzien van de website.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat is nimmer aansprakelijk voor indirecte oftewel gevolgschade geleden door de dan+doen+we+dat-lid of een derde in verband met de door Dan+doen+we+dat geleverde activiteit\\/ evenementen. Onder indirecte schade wordt niet-limitatief bedoeld begrepen, gederfde winst, geleden verlies, gemiste besparingen en schade als gevolg van bedrijfsstagnatie.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Indien Dan+doen+we+dat ondanks het bepaalde in deze algemene voorwaarden toch aansprakelijk is voor schade als gevolg van een aan hem toerekenbare tekortkoming in de nakoming van een transactie met de dan+doen+we+dat-lid, is die aansprakelijkheid beperkt tot ten hoogste de factuurwaarde van de participatie aan een bepaald evenement, dan wel de verkochte dienst.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Om haar eventuele aanspraken jegens Dan+doen+we+dat geldig te maken, dient de dan+doen+we+dat-lid daarvan, onverminderd de dwingende wettelijke rechten van consumenten, binnen een maand na ontstaan van die aanspraak met bescheiden gestaafd en deugdelijk onderbouwd, het bestaan van deze vermeende aanspraak schriftelijk aan Dan+doen+we+dat mede te delen, op straffe van verval van recht. Behoudens de dwingende wettelijke rechten van consumenten verjaren alle vorderingen en verweren jegens Dan+doen+we+dat door verloop van &eacute;&eacute;n jaar.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Deelname aan alle events is altijd 100 % voor eigen risico van jou als lid van dan+doen+we+dat of jouw introduc&eacute;.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">dan+doen+we+dat aanvaardt geen aansprakelijkheid voor hinderlijk gedrag van derden of enig ander uit het contact tussen&nbsp;deelnemers onderling voortvloeiend ongemak. dan+doen+we+dat sluit ook alle aansprakelijkheid uit voor het gebruik door&nbsp;derden van door een lid van dan+doen+we+dat gepubliceerde persoonlijke informatie op de dan+doen+we+dat-website. Dat geldt eveneens voor aansprakelijkheid voor de daden of nalatigheden van andere dan+doen+we+dat ers\\/ proefleden\\/ introduc&eacute;s, in welke vorm dan ook.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">ARTIKEL 9.&nbsp;<\\/span><span class=\\\"s6\\\">OVERMACHT<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat is niet gehouden tot het nakomen van enige verplichting indien hij daartoe gehinderd wordt door een omstandigheid die hem krachtens de wet, een rechtshandeling of in het maatschappelijk verkeer geldende opvattingen niet kan worden toegerekend.&nbsp;<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Gedurende de periode van overmacht worden de verplichtingen van partijen ten aanzien waarvan de nakoming door overmacht wordt belemmerd, opgeschort.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Indien de nakoming van een verbintenis door overmacht blijvend onmogelijk wordt, zijn partijen gerechtigd de verbintenis met onmiddellijke ingang te ontbinden.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Indien Dan+doen+we+dat bij het intreden van de overmachtsituatie reeds gedeeltelijk aan zijn verplichtingen heeft voldaan of slechts gedeeltelijk aan zijn verplichtingen kan voldoen, is hij gerechtigd het reeds uitgevoerde gedeelte, respectievelijk uitvoerbare gedeelte van de verbintenis afzonderlijk te factureren als ware er sprake van een zelfstandige overeenkomst.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Schade als gevolg van overmacht, anders dan kwijtschelding of restitutie van de overeengekomen prijs naar evenredigheid van het gedeelte van de overeenkomst dat door overmacht is getroffen, komt nimmer voor vergoeding in aanmerking.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">ARTIKEL 10.&nbsp;<\\/span><span class=\\\"s6\\\">KLACHTEN<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Klachten dienen binnen bekwame tijd na ontstaan daarvan gemotiveerd te worden ingediend bij Dan+doen+we+dat. De dan+doen+we+dat-lid is gehouden Dan+doen+we+dat en\\/of de Host\\/ Organisator alle medewerking te verlenen en informatie te verstrekken die redelijkerwijs kan bijdragen aan de oplossing van de klacht en beperking van eventuele schade.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Klachten omtrent de dienstverlening van Dan+doen+we+dat, alsmede omtrent de hoogte van door de dan+doen+we+dat-lid verschuldigde (koop)prijzen, dienen zo spoedig mogelijk, doch uiterlijk een maand nadat de dan+doen+we+dat-lid van de vermeende gebreken die tot de klacht hebben geleid kennis droeg of redelijkerwijs kennis had kunnen dragen, schriftelijk en gemotiveerd te worden ingediend bij Dan+doen+we+dat.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Klachten omtrent de uitvoering van diensten te leveren of geleverd door de Host\\/ Organisator, dienen ter plaatse zo spoedig mogelijk bij de betreffende Host\\/ Organisator te worden gemeld. Indien een dergelijke klacht niet naar tevredenheid van de dan+doen+we+dat-lid wordt opgelost, dient de klacht overeenkomstig het vorige lid aan zowel Dan+doen+we+dat als de Host\\/ Organisator te worden gericht.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 11.&nbsp;<\\/span><span class=\\\"s1\\\">UITSLUITING EN\\/OF VERWIJDERING<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat is gerechtigd de dan+doen+we+dat-lid van gebruik van de door Dan+doen+we+dat aangeboden diensten uit te sluiten in geval:<\\/span><\\/li>\\r\\n<ul class=\\\"ul1\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">de dan+doen+we+dat-lid in strijd handelt met deze algemene voorwaarden;<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">de dan+doen+we+dat-lid het voor Dan+doen+we+dat onmogelijk maakt de door haar ingevulde gegevens op juistheid te controleren;<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">indien de dan+doen+we+dat-lid de eer of de goede naam van Dan+doen+we+dat aantast, al dan niet door gebruik van aanstootgevende of beledigende gebruikersnamen, of;<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">indien de dan+doen+we+dat-lid de dienstverlening en\\/of onderneming van Dan+doen+we+dat op enigerlei andere wijze verstoort.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Uitingen die discriminerend, hinderlijk, provocerend, lasterlijk of bedreigend zijn.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\">Inbreuk maken op de privacy van anderen.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Eventuele tegoeden die op het moment van uitsluiting en\\/of verwijdering van de dan+doen+we+dat-lid op haar account aanwezig zijn, komen te vervallen. Door de betreffende dan+doen+we+dat-lid reeds betaalde bedragen worden niet gerestitueerd.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">De rechten van Dan+doen+we+dat als bedoeld in lid 1 kunnen niet worden ingeroepen voor zover de tekortkoming van de dan+doen+we+dat-lid de betreffende maatregel niet rechtvaardigt.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">ARTIKEL 12.&nbsp;<\\/span><span class=\\\"s6\\\">PRIVACY<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat respecteert de privacy van alle gebruikers van zijn diensten. Dan+doen+we+dat staat ervoor in dat persoonsgegevens conform de Wet bescherming persoonsgegevens worden verwerkt.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">De door de dan+doen+we+dat-lid verstrekte persoonsgegevens worden uitsluitend gebruikt om de uitvoering van de diensten door Dan+doen+we+dat mogelijk te maken. Behoudens voor zover zij bij de uitvoering van transacties zijn betrokken, verstrekt Dan+doen+we+dat persoonsgegevens van de dan+doen+we+dat-lid nimmer aan derden.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat zal de dan+doen+we+dat-lid die zich op die berichtgevingen heeft geabonneerd informeren over aanbiedingen en diensten van Dan+doen+we+dat, dan wel bij hem aangesloten partners. De dan+doen+we+dat-lid kan zich voor deze berichtgevingen afmelden op de daartoe voorgeschreven wijze. Door inschrijving voor de nieuwsbrief van Dan+doen+we+dat gaat de dan+doen+we+dat-lid akkoord met de door Dan+doen+we+dat vastgestelde voorwaarden ter zake die nieuwsbrief. Voorts gaat de dan+doen+we+dat-lid door die inschrijving akkoord met het feit dat zij benaderd kan worden om abonnee te worden van nieuwsbrieven.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Voor meer informatie omtrent privacy wordt de dan+doen+we+dat-lid verwezen naar het privacy statement van Dan+doen+we+dat, welke op de website is gepubliceerd.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 13.&nbsp;<\\/span><span class=\\\"s1\\\">INTELLECTUELE EIGENDOM<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat, behouden zich alle rechten van intellectueel eigendom voor ter zake producten en diensten, de website, inclusief de daarop geplaatste ontwerpen, programmatuur en documentatie, en alle andere materialen die worden ontwikkeld en\\/of gebruikt ter voorbereiding of uitvoering van transacties tussen Dan+doen+we+dat en de dan+doen+we+dat-lid, dan wel die daaruit voortvloeien. De levering van producten en diensten strekt niet tot enige overdracht van rechten van intellectuele eigendom.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Het is de dan+doen+we+dat-lid niet toegestaan goederen waarop rechten van intellectuele eigendom van Dan+doen+we+dat of derden rusten, te verveelvoudigen, te openbaren of anderszins ter beschikking van derden te stellen, tenzij uit het gebruik van geleverde diensten of producten noodzakelijkerwijs anders voortvloeit, dan wel dit geschiedt met voorafgaande instemming van de rechthebbende.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">De dan+doen+we+dat-lid zal aanduidingen van Dan+doen+we+dat betreffende rechten van intellectuele eigendom niet verwijderen of wijzigen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Je stemt er mee in dat de dan+doen+we+dat-website bestanden, afbeeldingen, foto&rsquo;s, andere content en programma&rsquo;s bevat&nbsp;die eigendom van dan+doen+we+dat zijn, licentiegevers en\\/of gebruikers van dan+doen+we+dat en die beschermd worden door&nbsp;toepasselijke intellectuele eigendomsrechten, waaronder (maar niet beperkt tot) auteursrechten, merken en&nbsp;octrooien. Je verklaart geen handelingen te zullen verrichten die inbreuk kunnen maken op de (intellectuele&nbsp;eigendom) rechten van dan+doen+we+dat of derden. Je erkent en aanvaardt dat enig ongeoorloofd gebruik van bestanden,&nbsp;gegevens en materialen waarop intellectuele eigendomsrechten rusten, inbreuk maakt op deze voorwaarden en&nbsp;op de toepasselijke wetgeving, waaronder maar niet beperkt tot de Auteurswet.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 14.&nbsp;<\\/span><span class=\\\"s1\\\">SLOTBEPALINGEN<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Voor vragen of klachten kan per e-mail contact met Dan+doen+we+dat worden opgenomen middels het contactformulier op de website. Op elke rechtsverhouding tussen de dan+doen+we+dat-lid en Dan+doen+we+dat is uitsluitend Nederlands recht van toepassing.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Indien tussen partijen een juridisch geschil mocht ontstaat, zijn partijen, alvorens een beroep te doen op de rechter, verplicht zich optimaal in te spannen om het geschil in onderling overleg te beslechten.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Tenzij de wet dwingend anders voorschrijft, wordt uitsluitend de bevoegde rechter binnen het arrondissement van de vestigingsplaats van Dan+doen+we+dat aangewezen om van geschillen kennis te nemen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat is te allen tijde gerechtigd deze algemene voorwaarden te wijzigen of aan te vullen. Wijzigingen gelden ook ten aanzien van de reeds geregistreerde dan+doen+we+dat-lid met inachtneming van een termijn van dertig dagen na bekendmaking daarvan, dan wel een andere termijn indien dit bij de bekendmaking is vermeld.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">De Nederlandse versie van deze algemene voorwaarden is steeds bepalend voor de uitleg van de hierin opgenomen bedingen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">dan+doen+we+dat heeft zich ingespannen om met zorg deze gebruiksvoorwaarden op te stellen. Indien een of meer bepalingen van deze gebruiksvoorwaarden desondanks nietig zijn of vernietigd worden dan blijven de overige bepalingen onverminderd van kracht en dienen de nietige bepalingen vervangen te worden in rechtsgeldige bedingen. Deze moeten zoveel mogelijk aansluiten bij het oorspronkelijke doel van de betreffende bepalingen en ten gunste van dan+doen+we+dat strekken.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\",\"name\":\"core.rich-text-block\",\"nomobile\":\"1\"}',NULL),(1180,8,'container','left',553,4,'[\"[]\"]',NULL),(1185,3,'widget','sesevent.category-carousel',766,5,'{\"title_truncation_grid\":\"45\",\"description_truncation_grid\":\"45\",\"h