1_width\":\"500\",\"sesact_image1_height\":\"450\",\"sesact_image2\":null,\"sesact_image2_width\":\"289\",\"sesact_image2_height\":\"200\",\"sesact_image3\":null,\"sesact_image3_bigwidth\":\"328\",\"sesact_image3_bigheight\":\"300\",\"sesact_image3_smallwidth\":\"250\",\"sesact_image3_smallheight\":\"150\",\"sesact_image4\":null,\"sesact_image4_bigwidth\":\"578\",\"sesact_image4_bigheight\":\"300\",\"sesact_image4_smallwidth\":\"192\",\"sesact_image4_smallheight\":\"100\",\"sesact_image5\":null,\"sesact_image5_bigwidth\":\"289\",\"sesact_image5_bigheight\":\"260\",\"sesact_image5_smallwidth\":\"289\",\"sesact_image5_smallheight\":\"130\",\"sesact_image6\":null,\"sesact_image6_width\":\"289\",\"sesact_image6_height\":\"150\",\"sesact_image7\":null,\"sesact_image7_bigwidth\":\"192\",\"sesact_image7_bigheight\":\"150\",\"sesact_image7_smallwidth\":\"144\",\"sesact_image7_smallheight\":\"150\",\"sesact_image8\":null,\"sesact_image8_width\":\"144\",\"sesact_image8_height\":\"150\",\"sesact_image9\":null,\"sesact_image9_width\":\"192\",\"sesact_image9_height\":\"150\",\"nomobile\":\"0\",\"name\":\"sesadvancedactivity.feed\"}',NULL),(1236,76,'container','right',1232,5,'[\"[]\"]',NULL),(1238,76,'widget','user.list-popular',1236,10,'{\"title\":\"Popular Members\"}',NULL),(1240,76,'widget','user.home-photo',1234,3,'[\"[]\"]',NULL),(1242,76,'widget','user.list-signups',1236,9,'{\"title\":\"Recent Signups\"}',NULL),(1264,76,'widget','core.statistics',1234,5,'{\"title\":\"Statistics\"}',NULL),(1266,76,'widget','user.home-links',1234,4,'[\"[]\"]',NULL),(1272,76,'widget','user.browse-search',1236,11,'[\"[]\"]',NULL),(1284,65,'widget','seseventreview.profile-options',1048,29,'{\"title\":\"\",\"name\":\"seseventreview.profile-options\"}',NULL),(1287,49,'widget','sesevent.add-to-calendar',927,11,'{\"options\":[\"google\",\"yahoo\",\"msn\",\"outlook\",\"ical\"],\"title\":\"\",\"nomobile\":\"0\",\"name\":\"sesevent.add-to-calendar\"}',NULL),(1288,49,'widget','sesevent.event-map',925,5,'{\"title\":\"Map\",\"titleCount\":true,\"name\":\"sesevent.event-map\"}',NULL),(1294,2,'widget','sesgdpr.cookie-banner',200,4,'[\"[]\"]',NULL),(1299,7,'widget','sesgdpr.cookie-banner',551,6,'[\"[]\"]',NULL),(1302,77,'container','main',NULL,2,'[\"[]\"]',NULL),(1303,77,'container','middle',1302,6,'[\"[]\"]',NULL),(1304,77,'container','left',1302,4,'[\"[]\"]',NULL),(1305,77,'container','right',1302,5,'[\"[]\"]',NULL),(1311,77,'widget','core.rich-text-block',1303,4,'{\"title\":\"\",\"adminTitle\":\"\",\"data\":\"<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><strong><span class=\\\"s1\\\">Cookieverklaring<\\/span><\\/strong><\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><strong><span class=\\\"s1\\\">Wat is een cookie?<\\/span><\\/strong><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">We maken op onze website gebruik van cookies. Een cookie is een eenvoudig klein bestandje dat met pagina&rsquo;s van deze website wordt meegestuurd en door jouw browser op de harde schrijf van jouw computer wordt opgeslagen. De daarin opgeslagen informatie kan bij een volgend bezoek weer naar onze servers teruggestuurd worden.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><strong><span class=\\\"s1\\\">Functionele cookies<\\/span>&nbsp;<\\/strong><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Met behulp van een functionele cookie kunnen wij jou herkennen bij een herhaald bezoek op onze website. De website kan daardoor speciaal op jouw voorkeuren worden ingesteld. Ook wanneer je toestemming hebt gegeven voor het plaatsen van cookies kunnen wij dit door middel van een cookie onthouden. Op deze manier hoef je niet steeds jouw voorkeuren te herhalen waardoor je dus tijd bespaart en prettiger gebruik van onze website kunt maken. Functionele cookies kunnen verwijderd worden via de instellingen van jouw browser.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><strong><span class=\\\"s1\\\">Analytische cookies<\\/span>&nbsp;<\\/strong><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Analytische cookies worden gebruikt om te kunnen zien welke onderdelen van de website je met dit bezoek hebt bekeken. Op deze manier kunnen we onze dienst(en) zoveel mogelijk aanpassen op het surfgedrag van onze bezoekers. Deze cookies worden automatisch verwijderd zodra je jouw webbrowser afsluit.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><strong><span class=\\\"s1\\\">Google Analytics<\\/span>&nbsp;<\\/strong><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">We gebruiken de &lsquo;&rsquo;Analytics&rsquo;&rsquo; dienst van het Amerikaanse bedrijf Google. Via onze website wordt een cookie geplaatst van Google. Op deze manier kunnen we bijhouden en rapportages krijgen over hoe bezoekers de website gebruiken. Google kan deze informatie aan derden verschaffen indien Google hiertoe wettelijk wordt verplicht, of voor zover derden de informatie namens Google verwerken. Wij hebben hier geen invloed op. Wij hebben Google niet toegestaan de verkregen analytics informatie te gebruiken voor andere Google diensten.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Google anonimiseert de verzamelde informatie zo veel mogelijk. Jouw IP-adres wordt niet meegegeven. De informatie wordt overgebracht naar en door Google opgeslagen op servers in de Verenigde Staten. Google stelt zich te houden aan de Privacy Shield principles en is aangesloten bij het Privacy Shield-programma van het Amerikaanse Ministerie van Handel. Op deze manier is er sprake van een passend beschermingsniveau voor de verwerking van eventuele persoonsgegevens.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><strong><span class=\\\"s1\\\">Sociale netwerken<\\/span>&nbsp;<\\/strong><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">We hebben op onze website buttons opgenomen om webpagina&rsquo;s te kunnen promoten (&ldquo;liken&rdquo;) of delen (&ldquo;tweeten&rdquo;) op sociale netwerken als Facebook en Twitter. De buttons werken door middel van stukjes code die van Facebook respectievelijk Twitter zelf afkomstig zijn. Met deze code worden cookies geplaatst. Wij hebben daar geen invloed op. Lees de privacyverklaring van Facebook respectievelijk van Twitter (welke regelmatig kunnen wijzigen) om te lezen wat zij met jouw (persoons)gegevens doen die zij via deze cookies verwerken.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Deze partijen anonimiseren de verzamelde informatie zo veel mogelijk. De informatie wordt overgebracht naar en door Twitter, Facebook, Google + en LinkedIn opgeslagen op servers in de Verenigde Staten. LinkedIn, Twitter, Facebook en Google + stellen zich te houden aan de Privacy Shield principes en zijn aangesloten bij het Privacy Shield-programma van het Amerikaanse Ministerie van Handel. Op deze manier is er sprake van een passend beschermingsniveau voor de verwerking van eventuele persoonsgegevens.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><strong><span class=\\\"s1\\\">Recht op inzage en correctie of verwijdering van jouw gegevens<\\/span>&nbsp;<\\/strong><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Jij hebt het recht om te vragen om inzage in en correctie of verwijdering van jouw gegevens. Onze contactgegevens vind je op onze contactpagina. We kunnen je vragen om je te identificeren, dit doen we om misbruik te voorkomen. Wanneer je inzage wilt in persoonsgegevens gekoppeld aan een cookie, vragen wij je een kopie van de cookie in kwestie mee te sturen. Je kunt deze terugvinden in de instellingen van jouw browser.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><strong><span class=\\\"s1\\\">In- en uitschakelen van cookies en verwijdering daarvan<\\/span>&nbsp;<\\/strong><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Meer informatie omtrent het in- en uitschakelen en het verwijderen van cookies kun je vinden in de instructies en\\/of met behulp van de Help-functie van jouw browser.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p5\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\",\"name\":\"core.rich-text-block\",\"nomobile\":\"0\"}',NULL),(1319,77,'widget','core.layout-column-width',1305,6,'{\"title\":\"\",\"columnWidth\":\"\",\"columnWidthType\":\"px\",\"nomobile\":\"0\",\"name\":\"core.layout-column-width\"}',NULL),(1321,8,'widget','core.layout-column-width',1186,6,'{\"title\":\"\",\"columnWidth\":\"\",\"columnWidthType\":\"px\",\"nomobile\":\"0\",\"name\":\"core.layout-column-width\"}',NULL),(1326,7,'container','bottom',NULL,3,'[\"[]\"]',NULL),(1327,7,'container','middle',1326,6,'[\"[]\"]',NULL),(1332,78,'container','top',NULL,1,NULL,NULL),(1333,78,'container','main',NULL,2,NULL,NULL),(1334,78,'container','middle',1332,1,NULL,NULL),(1335,78,'container','middle',1333,2,NULL,NULL),(1336,78,'container','left',1333,1,NULL,NULL),(1337,78,'widget','sesadvancedactivity.feed',1335,1,NULL,NULL),(1338,78,'widget','sesadvancedactivity.onthisday-banner',1335,1,NULL,NULL),(1339,78,'widget','user.home-links',1336,1,NULL,NULL),(1340,78,'widget','core.statistics',1336,2,NULL,NULL),(1341,79,'container','main',NULL,2,NULL,NULL),(1342,79,'container','middle',1341,2,NULL,NULL),(1343,79,'widget','sesadvancedactivity.welcometab-sections',1342,1,'{\"title\":\"\",\"displaysections\":\"4\",\"nomobile\":\"0\",\"name\":\"sesadvancedactivity.welcometab-sections\"}',NULL),(1344,79,'widget','sesbasic.simple-html-block',1342,2,'{\"bodysimple\":\"<div class=\\\"sesact_welcome_txt_block sesbasic_clearfix\\\">\\r\\n  <p class=\\\"sesact_welcome_txt_block_des\\\">Welcome to the new feeds. You can now share your files, sell products, upload multiple photos, videos & much more. Schedule post to be shared at a later date and choose targeted audience for your posts. So, start sharing!!<\\/p>\\r\\n\\t<p class=\\\"sesact_welcome_txt_block_img\\\">\\r\\n\\t\\t<img src=\\\"application\\/modules\\/Sesadvancedactivity\\/externals\\/images\\/welcome.png\\\" alt=\\\"\\\" \\/>\\r\\n\\t<\\/p>\\r\\n<\\/div>\",\"show_content\":\"1\",\"title\":\"\",\"nomobile\":\"0\",\"name\":\"sesbasic.simple-html-block\"}',NULL),(1345,79,'widget','sesadvancedactivity.welcometab-sections',1342,3,'{\"title\":\"\",\"displaysections\":\"1\",\"nomobile\":\"0\",\"name\":\"sesadvancedactivity.welcometab-sections\"}',NULL),(1346,79,'widget','sesadvancedactivity.welcometab-sections',1342,4,'{\"title\":\"\",\"displaysections\":\"2\",\"nomobile\":\"0\",\"name\":\"sesadvancedactivity.welcometab-sections\"}',NULL),(1347,79,'widget','sesadvancedactivity.welcometab-sections',1342,5,'{\"title\":\"\",\"displaysections\":\"3\",\"nomobile\":\"0\",\"name\":\"sesadvancedactivity.welcometab-sections\"}',NULL),(1348,80,'container','top',NULL,1,NULL,NULL),(1349,80,'container','main',NULL,2,NULL,NULL),(1350,80,'container','middle',1348,1,NULL,NULL),(1351,80,'container','middle',1349,2,NULL,NULL),(1352,80,'container','left',1349,1,NULL,NULL),(1353,80,'container','right',1349,3,NULL,NULL),(1354,80,'widget','sesadvancedactivity.feed',1351,1,'{\"title\":\"What\'s New\",\"design\":\"3\",\"scrollfeed\":\"1\",\"autoloadTimes\":\"3\",\"userphotoalign\":\"left\",\"enablewidthsetting\":\"0\",\"sesact_image1\":null,\"sesact_image1_width\":\"500\",\"sesact_image1_height\":\"450\",\"sesact_image2\":null,\"sesact_image2_width\":\"289\",\"sesact_image2_height\":\"200\",\"sesact_image3\":null,\"sesact_image3_bigwidth\":\"328\",\"sesact_image3_bigheight\":\"300\",\"sesact_image3_smallwidth\":\"250\",\"sesact_image3_smallheight\":\"150\",\"sesact_image4\":null,\"sesact_image4_bigwidth\":\"578\",\"sesact_image4_bigheight\":\"300\",\"sesact_image4_smallwidth\":\"192\",\"sesact_image4_smallheight\":\"100\",\"sesact_image5\":null,\"sesact_image5_bigwidth\":\"289\",\"sesact_image5_bigheight\":\"260\",\"sesact_image5_smallwidth\":\"289\",\"sesact_image5_smallheight\":\"130\",\"sesact_image6\":null,\"sesact_image6_width\":\"289\",\"sesact_image6_height\":\"150\",\"sesact_image7\":null,\"sesact_image7_bigwidth\":\"192\",\"sesact_image7_bigheight\":\"150\",\"sesact_image7_smallwidth\":\"144\",\"sesact_image7_smallheight\":\"150\",\"sesact_image8\":null,\"sesact_image8_width\":\"144\",\"sesact_image8_height\":\"150\",\"sesact_image9\":null,\"sesact_image9_width\":\"192\",\"sesact_image9_height\":\"150\",\"nomobile\":\"0\",\"name\":\"sesadvancedactivity.feed\"}',NULL),(1355,80,'widget','user.home-links',1352,2,NULL,NULL),(1356,80,'widget','core.statistics',1352,3,'{\"title\":\"Statistics\"}',NULL),(1357,80,'widget','sesadvancedactivity.top-trends',1353,4,'{\"title\":\"Trending\",\"limit\":\"10\",\"nomobile\":\"0\",\"name\":\"sesadvancedactivity.top-trends\"}',NULL),(1361,7,'widget','sesgdpr.privacy-center',551,7,'[\"[]\"]',NULL),(1362,7,'widget','core.rich-text-block',551,4,'{\"title\":\"\",\"adminTitle\":\"\",\"data\":\"<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><strong>Privacyreglement:<\\/strong><\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><strong><br><span style=\\\"color: #03a9f3; font-size: 36pt;\\\">dan+doen+we+dat<\\/span><\\/strong><\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">In ons Privacyreglement gebruiken wij een aantal definities (deze definities kunnen in enkelvoud en meervoud worden gebruikt):<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><strong>Cookie<\\/strong>: een klein bestand dat via een internetsite op (het IP-adres van) jouw computer wordt geplaatst en informatie over jouw bezoek aan de dan+doen+we+dat internetsite registreert;<br><\\/span><strong>Reglement<\\/strong>: dit privacyreglement;<br><span class=\\\"s1\\\"><strong>Privacywetgeving<\\/strong>: de Algemene Verordening Gegevensbescherming.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><strong>1. Toelichting op het Reglement<\\/strong><\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">dan+doen+we+dat mag de gegevens die jij aan haar verstrekt niet zonder meer verwerken. De Privacywetgeving is bedoeld om de privacy van personen te beschermen. Door deze wetgeving wordt het toegestane gebruik van jouw persoonsgegevens door anderen beperkt. Op grond van deze wet heeft dan+doen+we+dat de plicht om haar (potenti&euml;le) leden en zakelijke relaties:<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; op de hoogte te stellen van de wijze waarop en het doel waarmee gegevens door dan+doen+we+dat worden verwerkt;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; te melden wie de gegevens kunnen inzien;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; voor het verwerken van bepaalde gegevens toestemming te vragen.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">dan+doen+we+dat vindt jouw privacy belangrijk. Daarom geeft dan+doen+we+dat in dit Reglement een toelichting op hoe zij met jouw gegevens omgaat, wat het doel is van het gebruik daarvan en voor de verwerking van welke gegevens dan+doen+we+dat expliciet om jouw toestemming moet vragen.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><strong>2. De persoonsgegevens die dan+doen+we+dat gebruikt en het doel van het gebruik<\\/strong><\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">dan+doen+we+dat verwerkt (mogelijk) jouw persoonsgegevens als je lid wordt of bent van dan+doen+we+dat of als je via het contactformulier contact met ons opneemt. Leden van dan+doen+we+dat maken zelf een profiel aan en op dit profiel is de gebruikersnaam, foto, leeftijd, en geslacht te zien is. Leden kunnen ervoor kiezen om hun telefoonnummer met andere leden te delen. dan+doen+we+dat verzamelt qua persoonsgegevens jouw naam, e-mailadres, geboortedatum, foto en IBAN-nummer. De hiervoor genoemde persoonsgegevens zijn uiteraard niet te zien voor andere leden en\\/of derden. Indien je zakelijke relatie bent van dan+doen+we+dat worden mogelijk jouw naam, e-mailadres en telefoonnummer verwerkt. Deze gegevens stellen ons in staat om:<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; de overeenkomst die leden en zakelijke relaties met dan+doen+we+dat sluiten financieel en administratief te kunnen afhandelen;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; onze dienstverlening te kunnen leveren;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; leden, zakelijke relaties of ge&iuml;nteresseerden te kunnen bereiken als dat nodig is;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; om onze dienstverlening verder te ontwikkelen\\/te optimaliseren;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; jou op maat gesneden informatie aan te bieden (nieuwsbrief).<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">IP-adressen\\/cookies<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">dan+doen+we+dat houdt IP-adressen bij van (potenti&euml;le) leden of zakelijke relaties die de website bezoeken. Deze gegevens stellen ons in staat om:<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; te registreren welke internetsite\\/internetpagina&rsquo;s je bezoekt;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; de functionaliteit en de inhoud van de website te verbeteren;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; bij te houden voor welke onderwerpen of toepassingen (potenti&euml;le) leden of zakelijke relaties zich interesseren;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; ervoor te zorgen dat je niet steeds dezelfde informatie ontvangt;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; het productaanbod te verbeteren.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Toelichting met betrekking tot het plaatsen van cookies<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Als je onze website bezoekt worden er automatisch cookies geplaatst waardoor we aan de hand van jouw IP-adres bepaalde informatie kunnen bijhouden. Hierbij gaat het bijvoorbeeld om informatie over hoe vaak je onze website bezoekt en voor welke onderwerpen jij je interesseert. Zie voor meer informatie ons cookiebeleid op de website.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><strong>3. Verstrekking persoonsgegevens aan derden<\\/strong><\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">dan+doen+we+dat verstrekt geen persoonsgegevens aan personen of bedrijven buiten de dan+doen+we+dat-organisatie, tenzij:<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; dat verplicht is door een wettelijk voorschrift;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; dat noodzakelijk is voor het uitvoeren van een overeenkomst die dan+doen+we+dat met jou heeft gesloten;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; je daarvoor toestemming hebt gegeven.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><strong>4. Plichten\\/beveiligde toegang\\/geheimhouding\\/bewaartermijn<\\/strong><\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; dan+doen+we+dat verwerkt jouw persoonsgegevens uitsluitend overeenkomstig de wet. Dit houdt (onder meer) in dat de gegevens alleen worden verwerkt voor het doel waarvoor ze verkregen worden en op een behoorlijke\\/zorgvuldige wijze overeenkomstig de wet en dit Reglement.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; jouw persoonsgegevens kunnen enkel en alleen door personen werkzaam voor dan+doen+we+dat worden ingezien, tenzij in dit Reglement anders is bepaald. Al jouw persoonsgegevens worden door dan+doen+we+dat beveiligd tegen onbevoegde toegang. De beveiliging bestaat:<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; uit het hebben van een persoonlijk wachtwoord voor iedere persoon werkzaam voor dan+doen+we+dat om in te loggen in het digitale systeem.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; de personen werkzaam voor dan+doen+we+dat hebben een geheimhoudingsplicht ten aanzien van alle aan dan+doen+we+dat verstrekte persoonsgegevens;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; dan+doen+we+dat heeft technische maatregelen genomen om het door haar gebruikte systeem te beveiligen tegen inbreuken van buitenaf overeenkomstig de wet;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; jouw persoonsgegevens worden niet langer bewaard dan noodzakelijk is voor een goede administratie en\\/of andere vastgestelde doelen. dan+doen+we+dat hanteert een termijn van twee jaar nadat jij inactief of geen lid meer bent, waarna de gegevens vernietigd worden. Voor zakelijke relaties geldt dat de persoonsgegevens zo lang als nodig voor een goede bedrijfsvoering worden bewaard, met inachtneming van een redelijke termijn. De wet kan een andere bewaartermijn voorschrijven. Als dat zo is zal dan+doen+we+dat zich aan de voorgeschreven wettelijke bewaartermijn houden.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><strong>5. Jouw rechten als betrokkene<\\/strong><\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; recht op informatie: het recht om te weten of en welke persoonsgegevens van jou verwerkt worden en met welk doel;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; inzagerecht: het recht op inzage en afschrift van die gegevens voor zover de privacy van een ander daardoor niet wordt geschaad;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; het recht op correctie, aanvulling of verwijdering van gegevens indien dat nodig mocht zijn (recht op correctie en verwijdering). Aan het recht om (gedeeltelijke) verwijdering van jouw gegevens te vragen, kan alleen tegemoet gekomen worden als het bewaren van de gegevens voor een ander niet van aanmerkelijk belang is en de gegevens niet op grond van een wettelijke regeling bewaard dienen te blijven;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; het recht van verzet: het recht om je in bepaalde gevallen tegen de verwerking van jouw gegevens te verzetten;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; het recht op data-portabiliteit: het recht om de persoonsgegevens die van jou bewaard worden te ontvangen om over te kunnen dragen naar een andere organisatie;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; het recht op een menselijke blik bij geautomatiseerde besluiten. Bij een geautomatiseerd besluit is er het recht om de beslissing te laten nemen door menselijke tussenkomst.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Als je gebruik wilt maken van jouw rechten, dan kun je dit via onze Privacy Center aangeven, te bereiken via de pop-up \\\"Read More\\\"of onderaan de pagina in de footer daar kun je ook bij de&nbsp;Privacy Center. Je ontvangt binnen &eacute;&eacute;n maand na ontvangst van jouw verzoek bericht van dan+doen+we+dat.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><br> <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Ook als je een klacht hebt over de wijze van verwerking van jouw persoonsgegevens kun je contact met dan+doen+we+dat opnemen,<span class=\\\"Apple-converted-space\\\">&nbsp; <\\/span>dan+doen+we+dat probeert er samen met jou uit te komen.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><br> <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Heb je een (andere) opmerking\\/vraag\\/suggestie of wil je bezwaar maken tegen de nieuwsbrief door dan+doen+we+dat? Ook daarvoor kunt je schriftelijk contact met ons opnemen.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><br> <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Uiteraard zal dan+doen+we+dat ook met de in dit verband verstrekte persoonsgegevens vertrouwelijk en zorgvuldig omgaan.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><br> <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Onze actuele contactgegevens zijn te vinden op de website van dan+doen+we+dat.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">dan+doen+we+dat is een betaalde online social event community. De lage lidmaatschap-kosten die onze leden betalen vormen ons verdienmodel. Wij werken niet met commercials en wij delen nooit data van (potenti&euml;le) leden met derden.<br> <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><br> <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Privacyreglement dan+doen+we+dat versie maart 2020<\\/span><\\/p>\",\"name\":\"core.rich-text-block\",\"nomobile\":\"0\"}',NULL),(1363,5,'widget','user.profile-options',510,6,'{\"title\":\"\",\"name\":\"user.profile-options\"}',NULL),(1370,3,'widget','core.html-block',766,6,'{\"title\":\"\",\"adminTitle\":\"\",\"data\":\"\",\"nomobile\":\"0\",\"name\":\"core.html-block\"}',NULL),(1374,81,'container','main',NULL,2,'[\"[]\"]',NULL),(1375,81,'container','middle',1374,6,'[\"[]\"]',NULL),(1376,81,'container','left',1374,4,'[\"[]\"]',NULL),(1377,81,'container','right',1374,5,'[\"[]\"]',NULL),(1378,81,'container','top',NULL,1,'[\"[]\"]',NULL),(1379,81,'container','middle',1378,6,'[\"[]\"]',NULL),(1380,81,'widget','core.rich-text-block',1375,8,'{\"title\":\"\",\"adminTitle\":\"event regulations text\",\"data\":\"<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><strong>Spelregels Organisator<\\/strong><\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">1.Alle events worden door de deelnemers zelf opgezet. Deelname aan een event is altijd voor eigen risico. dan+doen+we+dat kan op geen enkele wijze aansprakelijk worden gesteld voor eventueel ontstane schade.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">2.Het opzetten van commerci&euml;le events is niet toegestaan. Commerci&euml;le events zijn events die voor de organisator resulteren in financieel of ander (indirect) gewin.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">3.Het maximum aantal deelnemers per event bedraagt 30 personen per event. De de dan+doen+we+dat redactie en organisatie is gerechtigd om events te organiseren voor meer dan 30 personen.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">4.De maximale kosten per deelnemer mogen niet meer dan een redelijk bedrag zijn m.b.t tot het evenement.&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">5.Events die je op de dan+doen+we+dat -site plaatst, worden geacht exclusieve dan+doen+we+dat -events te zijn. Dit betekent dat ze niet ook op andere sites mogen worden gepubliceerd waar ze toegankelijk zijn voor niet-dan+doen+we+dat leden. Je kunt natuurlijk wel andere mensen op jouw event wijzen en ze uitnodigen om mee te doen aan dan+doen+we+dat.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">6.Meerdaagse events kunnen niet worden georganiseerd door deelnemers, maar alleen door de dan+doen+we+dat redactie en organisatie.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">7.dan+doen+we+dat behoudt zich het recht voor om de tekst die je opgeeft bij het opzetten van een event te wijzigen, in te korten of te verwijderen indien dit passend of noodzakelijk wordt geacht.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">8.Events die overeenkomen of conflicteren met events van de dan+doen+we+dat -organisatie kunnen zonder nadere opgaaf van redenen worden geweigerd.<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">9.Zie ook de<span style=\\\"background-color: #ffffff;\\\">&nbsp;<strong><a style=\\\"background-color: #ffffff;\\\" href=\\\"https:\\/\\/dandoenwedat.com\\/help\\/terms\\\"><span style=\\\"color: #03a9f3;\\\">Algemene Voorwaarden<\\/span>.<\\/a> <\\/strong><\\/span><\\/span><\\/p>\",\"name\":\"core.rich-text-block\",\"nomobile\":\"0\"}',NULL),(1381,81,'widget','user.home-links',1377,10,'[\"[]\"]',NULL),(1383,81,'widget','core.banner',1379,3,'{\"name\":\"core.banner\",\"banner_id\":\"17\",\"title\":\"\",\"nomobile\":\"0\"}',NULL),(1386,81,'widget','core.layout-column-width',1377,11,'{\"title\":\"\",\"columnWidth\":\"\",\"columnWidthType\":\"px\",\"nomobile\":\"0\",\"name\":\"core.layout-column-width\"}',NULL),(1387,81,'widget','core.search-mini',1376,6,'[\"[]\"]',NULL),(1392,3,'widget','sesevent.featured-sponsored',766,4,'{\"viewType\":\"gridOutside\",\"gridInsideOutside\":\"in\",\"mouseOver\":\"\",\"order\":\"ongoingSPupcomming\",\"criteria\":\"5\",\"info\":\"creation_date\",\"show_criteria\":[\"title\",\"category\",\"location\",\"startenddate\",\"likeButton\",\"favouriteButton\"],\"socialshare_enable_plusicon\":\"1\",\"socialshare_icon_limit\":\"2\",\"grid_title_truncation\":\"45\",\"list_title_truncation\":\"45\",\"height\":\"360\",\"width\":\"360\",\"limit_data\":\"3\",\"title\":\"\",\"nomobile\":\"0\",\"name\":\"sesevent.featured-sponsored\"}',NULL),(1401,4,'widget','sesevent.event-guest-information',411,10,'{\"guestCount\":\"4\",\"height\":\"45\",\"width\":\"40\",\"title\":\"\",\"nomobile\":\"0\",\"name\":\"sesevent.event-guest-information\"}',NULL),(1402,4,'widget','sesevent.browse-menu-quick',411,15,'{\"popup\":\"0\",\"title\":\"\",\"nomobile\":\"0\",\"name\":\"sesevent.browse-menu-quick\"}',NULL),(1403,4,'widget','sesevent.featured-sponsored',412,5,'{\"viewType\":\"gridInside\",\"gridInsideOutside\":\"in\",\"mouseOver\":\"\",\"order\":\"\",\"criteria\":\"5\",\"info\":\"creation_date\",\"show_criteria\":[\"title\",\"location\"],\"socialshare_enable_plusicon\":\"1\",\"socialshare_icon_limit\":\"2\",\"grid_title_truncation\":\"45\",\"list_title_truncation\":\"45\",\"height\":\"165\",\"width\":\"165\",\"limit_data\":\"5\",\"title\":\"Popular Events\",\"nomobile\":\"0\",\"name\":\"sesevent.featured-sponsored\"}',NULL),(1427,5,'widget','user.home-links',510,7,'[\"[]\"]',NULL),(1474,4,'widget','sesevent.show-also-liked',411,14,'{\"title\":\"\",\"viewType\":\"list\",\"gridInsideOutside\":\"in\",\"mouseOver\":\"over\",\"order\":\"\",\"show_criteria\":\"\",\"socialshare_enable_plusicon\":\"1\",\"socialshare_icon_limit\":\"2\",\"grid_title_truncation\":\"45\",\"list_title_truncation\":\"45\",\"height\":\"180\",\"width\":\"180\",\"limit_data\":\"5\",\"nomobile\":\"0\",\"name\":\"sesevent.show-also-liked\"}',NULL),(1475,4,'widget','sesevent.hostoftheday',411,13,'{\"infoshow\":\"\",\"socialshare_enable_plusicon\":\"1\",\"socialshare_icon_limit\":\"2\",\"height\":\"200\",\"width\":\"200\",\"contentInsideOutside\":\"in\",\"mouseOver\":\"1\",\"title\":\"\",\"nomobile\":\"0\",\"name\":\"sesevent.hostoftheday\"}',NULL),(1477,4,'widget','sesevent.of-the-day',411,12,'{\"viewType\":\"list\",\"gridInsideOutside\":\"in\",\"mouseOver\":\"over\",\"show_criteria\":\"\",\"socialshare_enable_plusicon\":\"1\",\"socialshare_icon_limit\":\"2\",\"grid_title_truncation\":\"45\",\"list_title_truncation\":\"45\",\"height\":\"180\",\"width\":\"180\",\"title\":\"\",\"nomobile\":\"0\",\"name\":\"sesevent.of-the-day\"}',NULL),(1485,45,'widget','core.banner',800,13,'{\"name\":\"core.banner\",\"banner_id\":\"12\",\"title\":\"\",\"nomobile\":\"0\"}',NULL),(1486,45,'widget','core.rich-text-block',800,10,'{\"title\":\"\",\"adminTitle\":\"\",\"data\":\"<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\" style=\\\"font-size: 14pt;\\\"><strong>dan+doen+we+dat<\\/strong> is een creatieve, publieke, sociale organisatie; die inhoudelijke, verdiepende events<span class=\\\"Apple-converted-space\\\">&nbsp; <\\/span>en activiteiten organiseert. Maar ook sportieve, gekke en alledaagse uitstapjes. Voor iedereen van 18 tm 88 jaar.<\\/span><\\/p>\",\"name\":\"core.rich-text-block\",\"nomobile\":\"0\"}',NULL),(1487,45,'widget','core.banner',800,17,'{\"name\":\"core.banner\",\"banner_id\":\"13\",\"title\":\"\",\"nomobile\":\"0\"}',NULL),(1488,45,'widget','core.rich-text-block',800,12,'{\"title\":\"\",\"adminTitle\":\"\",\"data\":\"<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 12pt; font-family: helvetica, arial, sans-serif;\\\"><span style=\\\"font-size: 14pt;\\\"><span class=\\\"s1\\\">We gaan activiteiten en events organiseren om nog meer leuke dingen te beleven.&nbsp;<\\/span><span class=\\\"s1\\\">De komende tijd gaan we aan de slag om de activiteiten-agenda zo goed mogelijk te vullen met leuke activiteiten en events.&nbsp;<br><\\/span><\\/span><br><\\/span><\\/p>\",\"name\":\"core.rich-text-block\",\"nomobile\":\"0\"}',NULL),(1489,45,'widget','core.banner',800,9,'{\"name\":\"core.banner\",\"banner_id\":\"14\",\"title\":\"\",\"nomobile\":\"0\"}',NULL),(1490,45,'widget','core.rich-text-block',800,14,'{\"title\":\"\",\"adminTitle\":\"\",\"data\":\"<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 12pt; font-family: helvetica, arial, sans-serif;\\\"><span style=\\\"font-size: 14pt;\\\"><span class=\\\"s1\\\">We gaan er op uit. Aan activiteiten meedoen.&nbsp;&nbsp;<\\/span>En dat kan allemaal buiten of binnen. Nieuwe mensen leren kennen. <\\/span><span style=\\\"font-size: 14pt;\\\">Je kan zelf ook&nbsp;een event of activiteit organiseren. Een borrel, wandeling of een etentje. Buitenshuis of in het caf&eacute;. <\\/span><span style=\\\"font-size: 14pt;\\\">Het kan allemaal.<\\/span><br><\\/span><\\/p>\",\"name\":\"core.rich-text-block\",\"nomobile\":\"0\"}',NULL),(1491,45,'widget','core.banner',800,15,'{\"name\":\"core.banner\",\"banner_id\":\"15\",\"title\":\"\",\"nomobile\":\"0\"}',NULL),(1492,45,'widget','core.rich-text-block',800,16,'{\"title\":\"\",\"adminTitle\":\"\",\"data\":\"<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\" style=\\\"font-size: 14pt; font-family: helvetica, arial, sans-serif;\\\"><strong>dan+doen+we+dat<\\/strong> is er voor mensen die net verhuisd zijn en nieuw zijn in een woonplaats. Mensen die nieuwe mensen willen leren kennen. Voor vrienden, collega&rsquo;s, ondernemers, familieleden en vriendengroepjes. Mensen om mee te sporten. Om mee naar de film te gaan. Om te gaan borrelen of wandelen.<\\/span><\\/p>\",\"name\":\"core.rich-text-block\",\"nomobile\":\"0\"}',NULL),(1493,45,'widget','core.banner',800,11,'{\"name\":\"core.banner\",\"banner_id\":\"16\",\"title\":\"\",\"nomobile\":\"0\"}',NULL),(1494,45,'widget','core.rich-text-block',800,18,'{\"title\":\"\",\"adminTitle\":\"\",\"data\":\"<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 12pt; font-family: helvetica, arial, sans-serif;\\\">&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: center;\\\"><span class=\\\"s1\\\" style=\\\"font-size: 12pt; font-family: helvetica, arial, sans-serif;\\\">-&nbsp;<em>inschrijven is gratis.&nbsp;<\\/em><\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: center;\\\"><span class=\\\"s1\\\" style=\\\"font-size: 12pt; font-family: helvetica, arial, sans-serif;\\\"><em>Vragen? Stuur ons een berichtje via onderstaand contactformulier en we houden je op de hoogte!<\\/em><\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 12pt; font-family: helvetica, arial, sans-serif;\\\">&nbsp;<\\/span><\\/p>\",\"name\":\"core.rich-text-block\",\"nomobile\":\"0\"}',NULL),(1495,82,'container','main',NULL,2,'[\"[]\"]',NULL),(1496,82,'container','middle',1495,6,'[\"[]\"]',NULL),(1497,82,'container','left',1495,4,'[\"[]\"]',NULL),(1498,82,'container','right',1495,5,'[\"[]\"]',NULL),(1499,82,'widget','core.rich-text-block',1496,4,'{\"title\":\"\",\"adminTitle\":\"\",\"data\":\"<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><strong>Gebruiksvoorwaarden:<\\/strong><\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&nbsp;<\\/span><\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\"><span style=\\\"font-size: 36pt; color: #03a9f2;\\\"><span class=\\\"s2\\\"><strong>dan+do<\\/strong><\\/span><span class=\\\"s1\\\"><strong>en+we+dat<\\/strong><\\/span><\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">ARTIKEL 1.&nbsp;<\\/span><span class=\\\"s3\\\">DEFINITIES<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p5\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Voor zover uit de aard of strekking daarvan niet anders voortvloeit, worden de volgende termen in deze algemene voorwaarden, in de navolgende betekenis gebruikt.<\\/span><\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">dan+doen+we+dat: de gebruiker van deze algemene voorwaarden, gevestigd te Amsterdam, ingeschreven in het Handelsregister onder KvK-nummer &mdash;&mdash;&mdash;&mdash;<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat-lid: de natuurlijke persoon die zich middels de website heeft geregistreerd en daarmee in staat wordt gesteld van de diensten van dan+doen+we+dat gebruik te maken.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Host\\/ Organisator: de feitelijke Host\\/ Organisator van het product, de dienst, de activiteit\\/ event of het arrangement, welk product, welke dienst of arrangement op de website wordt aangeboden.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Activiteit\\/ Event:<br> Een enkel- of meervoudige actieve bezigheid die op de dan+doen+we+dat-website voor lid van dan+doen+we+dat vrijblijvend worden opgezet om te ondernemen, en met als doel om op een actieve en ontspannen&nbsp;manier deel te nemen aan activiteiten en events. Daaronder&nbsp;vallen onder meer feest- en uitgaansactiviteiten, sportieve en avontuurlijke events, kunst en cultuur, body&nbsp;en mind, persoonlijke ontwikkeling, andere diensten of faciliteiten en\\/of het gebruik van materialen,&nbsp;maaltijden en drank met dag- en\\/of nachtverblijf in binnen- of buitenland. Vervoer van en naar de plaats&nbsp;van event valt daar nooit onder.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Website: www.dandoenwedat.com<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 2.&nbsp;<\\/span><span class=\\\"s1\\\">ALGEMENE BEPALINGEN<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Deze algemene voorwaarden zijn van toepassing op alle activiteiten\\/ evenementen, transacties, overeenkomsten en andere rechtshandelingen die middels de website door de dan+doen+we+dat-lid met Dan+doen+we+dat worden aangegaan.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Bij registratie als bedoeld in het volgende artikel verklaart de dan+doen+we+dat-lid met de toepasselijkheid van de onderhavige voorwaarden in te stemmen, waarna deze voorwaarden stilzwijgend van toepassing zijn op de in het vorige lid bedoelde activiteit\\/ evenementen, transacties, overeenkomsten en andere rechtshandelingen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Van deze algemene voorwaarden kan uitsluitend uitdrukkelijk en schriftelijk worden afgeweken. Hetgeen partijen uitdrukkelijk schriftelijk zijn overeengekomen, prevaleert in geval van strijdigheid, boven het bepaalde in deze algemene voorwaarden.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">De toepasselijkheid van de algemene of andersluidende voorwaarden van de dan+doen+we+dat-lid wordt uitdrukkelijk van de hand gewezen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Vernietiging of nietigheid van &eacute;&eacute;n of meer der onderhavige bepalingen laat de geldigheid van de overige bedingen onverlet. In een voorkomend geval zijn partijen verplicht in onderling overleg te treden teneinde een vervangende regeling te treffen ten aanzien van het aangetaste beding. Daarbij wordt zoveel mogelijk het doel en de strekking van de oorspronkelijke bepaling in acht genomen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">dan+doen+we+dat behoudt zich het recht voor zonder voorafgaande aankondiging tarieven of inschrijvingsvereisten te&nbsp;wijzigen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Na aanmelding kan dan+doen+we+dat je zonder opgave van redenen weigeren het dan+doen+we+dat-lidmaatschap te verlenen. dan+doen+we+dat kan je op elk moment verzoeken om een identificatiebewijs te tonen. Indien je&nbsp;daaraan niet voldoet, heeft dan+doen+we+dat het recht zonder restitutie van gelden de toegang tot een event te weigeren en&nbsp;het dan+doen+we+dat-lidmaatschap te be&euml;indigen.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 3.&nbsp;<\\/span><span class=\\\"s1\\\">REGISTREREN EN BEVEILIGING<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Voor gebruikmaking van de diensten van Dan+doen+we+dat, dient de dan+doen+we+dat-lid zich op de website te registreren. De dan+doen+we+dat-lid is gehouden alle bij de registratie gevraagde gegevens volledig en naar waarheid te verstrekken. Registratie is uitsluitend toegestaan voor personen die de leeftijd van 18 jaren hebben bereikt. Dan+doen+we+dat draagt nimmer enige aansprakelijkheid voor schade die is ontstaan als gevolg van door de dan+doen+we+dat-lid onjuist of onvolledig verstrekte gegevens.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat bevestigt de registratie van de dan+doen+we+dat-lid langs elektronische weg. Na ontvangst van deze bevestiging is de dan+doen+we+dat-lid in staat middels haar inloggegevens van de diensten van Dan+doen+we+dat gebruik te maken.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Inloggegevens zijn strikt vertrouwelijk en persoonsgebonden. Het is de dan+doen+we+dat-lid niet toegestaan haar inloggegevens ter beschikking van derden te stellen. Alle handelingen die onder de account van de dan+doen+we+dat-lid worden verricht, worden de geregistreerde dan+doen+we+dat-lid toegerekend. Voor schade als gevolg van onbevoegd gebruik van inloggegevens door derden, draagt Dan+doen+we+dat nimmer enige aansprakelijkheid.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">In geval zich ten aanzien van de door de dan+doen+we+dat-lid bij de registratie opgegeven gegevens wijzigingen voordoen, is de dan+doen+we+dat-lid gehouden deze gegevens zo spoedig mogelijk onder haar account op de website te wijzigingen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">De dan+doen+we+dat-lid is te allen tijde in staat haar registratie ongedaan te maken op de daartoe op de website voorgeschreven wijze. Een dergelijke ongedaanmaking laat de verplichting tot nakoming van eventuele verbintenissen die de dan+doen+we+dat-lid is aangegaan voordat de registratie is ongedaan gemaakt, onverlet, evenals de toepasselijkheid van de bepalingen in deze algemene voorwaarden die naar hun aard of strekking ook na be&euml;indiging van de registratie van kracht blijven.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">De dan+doen+we+dat-lid is gehouden om de apparatuur waarmee de dan+doen+we+dat-lid zichzelf toegang verschaft tot de website afdoende en volgens gebruikelijke maatstaven te beveiligen tegen virussen, andere schadelijke componenten en onrechtmatige programma&rsquo;s en bestanden die zich kunnen verspreiden via het internet. Voorts dient dan+doen+we+dat-lid voldoende (beveiligings-) maatregelen te nemen om gebruik van haar inloggegevens door derden tegen te gaan.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 4.&nbsp;<\\/span><span class=\\\"s1\\\">AANBOD VAN ACTIVITEITEN EN EVENTS<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Zowel Dan+doen+we+dat als de Host\\/ Organisator zijn niet gebonden aan een aanbod van activiteit\\/ evenementen op de website dat een kennelijke fout of vergissing bevat.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Om van het aanbod van activiteit\\/ evenementen op de website gebruik te maken dient de dan+doen+we+dat-lid middels haar inloggegevens op de website in te loggen. De dan+doen+we+dat-lid staat er voor in dat zij volgens de wet gerechtigd is juridisch bindende overeenkomsten te sluiten. De dan+doen+we+dat-lid kan niet van het aanbod van producten en diensten gebruik maken in geval zij krachtens deze algemene voorwaarden tijdelijk of blijvend van deelname is uitgesloten.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Ten aanzien van activiteit\\/ evenementen die nog niet zijn gestart is de Host\\/ Organisator gerechtigd wijzigingen in het aanbod van de activiteit\\/ event&nbsp; aan te brengen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Elk aanbod van activiteit\\/ evenementen geschiedt onder voorbehoud van voldoende beschikbaarheid daarvan. De Host\\/ Organisator is niet gehouden tot levering van activiteit\\/ event over te gaan in geval deze niet leverbaar of beschikbaar zijn.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">In geval van discrepantie tussen mededelingen omtrent het aanbod van activiteit\\/ evenementen enerzijds en de mededelingen daaromtrent van de Host\\/ Organisators anderzijds, zijn de mededelingen van dan+doen+we+dat leidend.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Je kunt als lid van dan+doen+we+dat events voor deelname opzetten voor andere leden van dan+doen+we+dat. Deelname aan events opgezet door lid van dan+doen+we+dat is geheel vrijblijvend. Deelname vindt plaats door aanmelding via de dan+doen+we+dat-website. Het opzetten van&nbsp;commerci&euml;le events is niet toegestaan. Commerci&euml;le events zijn events die voor de organiserende lid van dan+doen+we+dat&nbsp;resulteren in financieel of ander gewin, een en ander naar uitsluitend oordeel van dan+doen+we+dat.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Aan de events kunnen beperkingen of voorwaarden worden verbonden (door bijvoorbeeld een leeftijdseis te&nbsp;stellen. Aan de omschrijving of de schatting van kosten kunnen geen rechten jegens dan+doen+we+dat worden ontleend. Bij&nbsp;het opzetten van events ben je verplicht je te houden aan de spelregels. Deze&nbsp;spelregels&nbsp;staan ook bij: <a title=\\\"event-regulations\\\" href=\\\"https:\\/\\/dandoenwedat.com\\/pages\\/event-regulations\\\">Spelregels Organisator\\/ Host.<\\/a><\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 5.&nbsp;<\\/span><span class=\\\"s1\\\">ETHIEK EN GEDRAGSNORMEN<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">De dan+doen+we+dat-lid is zich ervan bewust dat het plaatsen van berichten met een negatieve, beledigende, bedreigende, grove, obscene of wederrechtelijke aard of inslag, niet is toegestaan.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">De dan+doen+we+dat-lid is zich ervan bewust dat zonder expliciete toestemming van dan+doen+we+dat, het niet is toegestaan om reclame te maken voor andere producten, diensten of andere commerci&euml;le activiteit\\/ evenementen en doelen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Niet nakoming of een handelen of nalaten in strijd met voorafgaande leden staat op straffe van onmiddellijke be&euml;indiging van het lidmaatschap, zonder dat een recht op restitutie van betaalde gelden bestaat. Dit laat onverlet het recht van dan+doen+we+dat op volledige schadevergoeding bij ontstane schade.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 6.&nbsp;<\\/span><span class=\\\"s1\\\">UITSLUITING VAN DEELNAME EN VERBODSBEPALING<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">dan+doen+we+dat behoudt zich het recht voor je lidmaatschap op elk moment te be&euml;indigen en van deelname aan activiteit\\/ evenementen uit te sluiten, indien je gedrag, lichamelijke of geestelijke beperkingen of een andere omstandigheid daartoe aanleiding geeft. Dan+doen+we+dat is daartoe echter op geen enkele wijze verplicht, noch verantwoordelijk. dan+doen+we+dat is dan niet gehouden tot restitutie van gelden en heeft onverminderd het recht op volledige schadevergoeding bij eventueel ontstane schade.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">dan+doen+we+dat behoudt zich het recht voor om door jouw gepubliceerde berichten aan te passen of geheel of gedeeltelijk te verwijderen indien dit passend of noodzakelijk wordt geacht.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat-lid is jegens dan+doen+we+dat aansprakelijk voor schade of enig ander nadeel dat wordt veroorzaakt door het doen of nalaten van jezelf, of door jou toegelaten introduc&eacute;s of derden. Dan+doen+we+dat-lid vrijwaart dan+doen+we+dat volledig van aanspraken van anderen.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 7.&nbsp;<\\/span><span class=\\\"s1\\\">BETALINGSVOORWAARDEN<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Bij betaling aan Dan+doen+we+dat heeft dan+doen+we+dat-lid de mogelijkheid te betalen met (iDeal), PayPal.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Tenzij in de bevestigingsmail uitdrukkelijk anders is vermeld, is de dan+doen+we+dat-lid de door haar verschuldigde betalingen in verband met de transactie aan Dan+doen+we+dat verschuldigd.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Om de dienst of activiteit\\/ event op te eisen dient de dan+doen+we+dat-lid binnen 24 uur na totstandkoming van de betreffende transactie aan haar betalingsverplichting te voldoen. Betalingen dienen plaats te vinden op de wijze en in de valuta zoals door Dan+doen+we+dat in de bevestigingsmail is aangegeven.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Indien geen of niet-tijdige betaling plaatsvindt, is Dan+doen+we+dat gerechtigd de transactie te annuleren en de activiteit\\/ evenementen of diensten niet langer voor de dan+doen+we+dat-lid gereserveerd te (doen) houden.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 8.&nbsp;<\\/span><span class=\\\"s1\\\">AANSPRAKELIJKHEID<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat is nimmer aansprakelijk voor vermissing, verduistering of diefstal of schade, direct of indirect van of aan goederen van de dan+doen+we+dat-lid. <\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat selecteert Leden\\/ Host\\/ Organisators met de grootst mogelijke zorgvuldigheid. Dan+doen+we+dat staat echter niet in voor de kwaliteit van de door derden geleverde diensten en activiteit\\/ evenementen. Uitsluitend de betreffende Host\\/ Organisator draagt daarvoor de aansprakelijkheid. De dan+doen+we+dat-lid vrijwaart Dan+doen+we+dat van al haar aanspraken en aanspraken van derden ter zake.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat draagt nimmer enige aansprakelijkheid voor schade als gevolg van een omstandigheid die niet aan hem kan worden toegerekend, zoals, maar niet beperkt tot overmacht.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat draagt nimmer enige aansprakelijkheid voor schade ontstaan doordat hij is uitgegaan van door de dan+doen+we+dat-lid onjuist of onvolledig verstrekte gegevens.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat is niet aansprakelijk voor schade in verband met technische storingen van de website of andere toegankelijkheidsproblemen ten aanzien van de website.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat is nimmer aansprakelijk voor indirecte oftewel gevolgschade geleden door de dan+doen+we+dat-lid of een derde in verband met de door Dan+doen+we+dat geleverde activiteit\\/ evenementen. Onder indirecte schade wordt niet-limitatief bedoeld begrepen, gederfde winst, geleden verlies, gemiste besparingen en schade als gevolg van bedrijfsstagnatie.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Indien Dan+doen+we+dat ondanks het bepaalde in deze algemene voorwaarden toch aansprakelijk is voor schade als gevolg van een aan hem toerekenbare tekortkoming in de nakoming van een transactie met de dan+doen+we+dat-lid, is die aansprakelijkheid beperkt tot ten hoogste de factuurwaarde van de participatie aan een bepaald evenement, dan wel de verkochte dienst.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Om haar eventuele aanspraken jegens Dan+doen+we+dat geldig te maken, dient de dan+doen+we+dat-lid daarvan, onverminderd de dwingende wettelijke rechten van consumenten, binnen een maand na ontstaan van die aanspraak met bescheiden gestaafd en deugdelijk onderbouwd, het bestaan van deze vermeende aanspraak schriftelijk aan Dan+doen+we+dat mede te delen, op straffe van verval van recht. Behoudens de dwingende wettelijke rechten van consumenten verjaren alle vorderingen en verweren jegens Dan+doen+we+dat door verloop van &eacute;&eacute;n jaar.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Deelname aan alle events is altijd 100 % voor eigen risico van jou als lid van dan+doen+we+dat of jouw introduc&eacute;.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">dan+doen+we+dat aanvaardt geen aansprakelijkheid voor hinderlijk gedrag van derden of enig ander uit het contact tussen&nbsp;deelnemers onderling voortvloeiend ongemak. dan+doen+we+dat sluit ook alle aansprakelijkheid uit voor het gebruik door&nbsp;derden van door een lid van dan+doen+we+dat gepubliceerde persoonlijke informatie op de dan+doen+we+dat-website. Dat geldt eveneens voor aansprakelijkheid voor de daden of nalatigheden van andere dan+doen+we+dat ers\\/ proefleden\\/ introduc&eacute;s, in welke vorm dan ook.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">ARTIKEL 9.&nbsp;<\\/span><span class=\\\"s6\\\">OVERMACHT<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat is niet gehouden tot het nakomen van enige verplichting indien hij daartoe gehinderd wordt door een omstandigheid die hem krachtens de wet, een rechtshandeling of in het maatschappelijk verkeer geldende opvattingen niet kan worden toegerekend.&nbsp;<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Gedurende de periode van overmacht worden de verplichtingen van partijen ten aanzien waarvan de nakoming door overmacht wordt belemmerd, opgeschort.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Indien de nakoming van een verbintenis door overmacht blijvend onmogelijk wordt, zijn partijen gerechtigd de verbintenis met onmiddellijke ingang te ontbinden.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Indien Dan+doen+we+dat bij het intreden van de overmachtsituatie reeds gedeeltelijk aan zijn verplichtingen heeft voldaan of slechts gedeeltelijk aan zijn verplichtingen kan voldoen, is hij gerechtigd het reeds uitgevoerde gedeelte, respectievelijk uitvoerbare gedeelte van de verbintenis afzonderlijk te factureren als ware er sprake van een zelfstandige overeenkomst.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Schade als gevolg van overmacht, anders dan kwijtschelding of restitutie van de overeengekomen prijs naar evenredigheid van het gedeelte van de overeenkomst dat door overmacht is getroffen, komt nimmer voor vergoeding in aanmerking.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">ARTIKEL 10.&nbsp;<\\/span><span class=\\\"s6\\\">KLACHTEN<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Klachten dienen binnen bekwame tijd na ontstaan daarvan gemotiveerd te worden ingediend bij Dan+doen+we+dat. De dan+doen+we+dat-lid is gehouden Dan+doen+we+dat en\\/of de Host\\/ Organisator alle medewerking te verlenen en informatie te verstrekken die redelijkerwijs kan bijdragen aan de oplossing van de klacht en beperking van eventuele schade.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Klachten omtrent de dienstverlening van Dan+doen+we+dat, alsmede omtrent de hoogte van door de dan+doen+we+dat-lid verschuldigde (koop)prijzen, dienen zo spoedig mogelijk, doch uiterlijk een maand nadat de dan+doen+we+dat-lid van de vermeende gebreken die tot de klacht hebben geleid kennis droeg of redelijkerwijs kennis had kunnen dragen, schriftelijk en gemotiveerd te worden ingediend bij Dan+doen+we+dat.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Klachten omtrent de uitvoering van diensten te leveren of geleverd door de Host\\/ Organisator, dienen ter plaatse zo spoedig mogelijk bij de betreffende Host\\/ Organisator te worden gemeld. Indien een dergelijke klacht niet naar tevredenheid van de dan+doen+we+dat-lid wordt opgelost, dient de klacht overeenkomstig het vorige lid aan zowel Dan+doen+we+dat als de Host\\/ Organisator te worden gericht.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 11.&nbsp;<\\/span><span class=\\\"s1\\\">UITSLUITING EN\\/OF VERWIJDERING<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat is gerechtigd de dan+doen+we+dat-lid van gebruik van de door Dan+doen+we+dat aangeboden diensten uit te sluiten in geval:<\\/span><\\/li>\\r\\n<ul class=\\\"ul1\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">de dan+doen+we+dat-lid in strijd handelt met deze algemene voorwaarden;<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">de dan+doen+we+dat-lid het voor Dan+doen+we+dat onmogelijk maakt de door haar ingevulde gegevens op juistheid te controleren;<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">indien de dan+doen+we+dat-lid de eer of de goede naam van Dan+doen+we+dat aantast, al dan niet door gebruik van aanstootgevende of beledigende gebruikersnamen, of;<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">indien de dan+doen+we+dat-lid de dienstverlening en\\/of onderneming van Dan+doen+we+dat op enigerlei andere wijze verstoort.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Uitingen die discriminerend, hinderlijk, provocerend, lasterlijk of bedreigend zijn.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\">Inbreuk maken op de privacy van anderen.<\\/li>\\r\\n<\\/ul>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Eventuele tegoeden die op het moment van uitsluiting en\\/of verwijdering van de dan+doen+we+dat-lid op haar account aanwezig zijn, komen te vervallen. Door de betreffende dan+doen+we+dat-lid reeds betaalde bedragen worden niet gerestitueerd.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">De rechten van Dan+doen+we+dat als bedoeld in lid 1 kunnen niet worden ingeroepen voor zover de tekortkoming van de dan+doen+we+dat-lid de betreffende maatregel niet rechtvaardigt.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">ARTIKEL 12.&nbsp;<\\/span><span class=\\\"s6\\\">PRIVACY<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat respecteert de privacy van alle gebruikers van zijn diensten. Dan+doen+we+dat staat ervoor in dat persoonsgegevens conform de Wet bescherming persoonsgegevens worden verwerkt.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">De door de dan+doen+we+dat-lid verstrekte persoonsgegevens worden uitsluitend gebruikt om de uitvoering van de diensten door Dan+doen+we+dat mogelijk te maken. Behoudens voor zover zij bij de uitvoering van transacties zijn betrokken, verstrekt Dan+doen+we+dat persoonsgegevens van de dan+doen+we+dat-lid nimmer aan derden.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat zal de dan+doen+we+dat-lid die zich op die berichtgevingen heeft geabonneerd informeren over aanbiedingen en diensten van Dan+doen+we+dat, dan wel bij hem aangesloten partners. De dan+doen+we+dat-lid kan zich voor deze berichtgevingen afmelden op de daartoe voorgeschreven wijze. Door inschrijving voor de nieuwsbrief van Dan+doen+we+dat gaat de dan+doen+we+dat-lid akkoord met de door Dan+doen+we+dat vastgestelde voorwaarden ter zake die nieuwsbrief. Voorts gaat de dan+doen+we+dat-lid door die inschrijving akkoord met het feit dat zij benaderd kan worden om abonnee te worden van nieuwsbrieven.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Voor meer informatie omtrent privacy wordt de dan+doen+we+dat-lid verwezen naar het privacy statement van Dan+doen+we+dat, welke op de website is gepubliceerd.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 13.&nbsp;<\\/span><span class=\\\"s1\\\">INTELLECTUELE EIGENDOM<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat, behouden zich alle rechten van intellectueel eigendom voor ter zake producten en diensten, de website, inclusief de daarop geplaatste ontwerpen, programmatuur en documentatie, en alle andere materialen die worden ontwikkeld en\\/of gebruikt ter voorbereiding of uitvoering van transacties tussen Dan+doen+we+dat en de dan+doen+we+dat-lid, dan wel die daaruit voortvloeien. De levering van producten en diensten strekt niet tot enige overdracht van rechten van intellectuele eigendom.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Het is de dan+doen+we+dat-lid niet toegestaan goederen waarop rechten van intellectuele eigendom van Dan+doen+we+dat of derden rusten, te verveelvoudigen, te openbaren of anderszins ter beschikking van derden te stellen, tenzij uit het gebruik van geleverde diensten of producten noodzakelijkerwijs anders voortvloeit, dan wel dit geschiedt met voorafgaande instemming van de rechthebbende.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">De dan+doen+we+dat-lid zal aanduidingen van Dan+doen+we+dat betreffende rechten van intellectuele eigendom niet verwijderen of wijzigen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Je stemt er mee in dat de dan+doen+we+dat-website bestanden, afbeeldingen, foto&rsquo;s, andere content en programma&rsquo;s bevat&nbsp;die eigendom van dan+doen+we+dat zijn, licentiegevers en\\/of gebruikers van dan+doen+we+dat en die beschermd worden door&nbsp;toepasselijke intellectuele eigendomsrechten, waaronder (maar niet beperkt tot) auteursrechten, merken en&nbsp;octrooien. Je verklaart geen handelingen te zullen verrichten die inbreuk kunnen maken op de (intellectuele&nbsp;eigendom) rechten van dan+doen+we+dat of derden. Je erkent en aanvaardt dat enig ongeoorloofd gebruik van bestanden,&nbsp;gegevens en materialen waarop intellectuele eigendomsrechten rusten, inbreuk maakt op deze voorwaarden en&nbsp;op de toepasselijke wetgeving, waaronder maar niet beperkt tot de Auteurswet.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s5\\\">ARTIKEL 14.&nbsp;<\\/span><span class=\\\"s1\\\">SLOTBEPALINGEN<\\/span><\\/p>\\r\\n<p class=\\\"p7\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<ol class=\\\"ol1\\\" style=\\\"text-align: justify;\\\">\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Voor vragen of klachten kan per e-mail contact met Dan+doen+we+dat worden opgenomen middels het contactformulier op de website. Op elke rechtsverhouding tussen de dan+doen+we+dat-lid en Dan+doen+we+dat is uitsluitend Nederlands recht van toepassing.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Indien tussen partijen een juridisch geschil mocht ontstaat, zijn partijen, alvorens een beroep te doen op de rechter, verplicht zich optimaal in te spannen om het geschil in onderling overleg te beslechten.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Tenzij de wet dwingend anders voorschrijft, wordt uitsluitend de bevoegde rechter binnen het arrondissement van de vestigingsplaats van Dan+doen+we+dat aangewezen om van geschillen kennis te nemen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">Dan+doen+we+dat is te allen tijde gerechtigd deze algemene voorwaarden te wijzigen of aan te vullen. Wijzigingen gelden ook ten aanzien van de reeds geregistreerde dan+doen+we+dat-lid met inachtneming van een termijn van dertig dagen na bekendmaking daarvan, dan wel een andere termijn indien dit bij de bekendmaking is vermeld.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">De Nederlandse versie van deze algemene voorwaarden is steeds bepalend voor de uitleg van de hierin opgenomen bedingen.<\\/span><\\/li>\\r\\n<li class=\\\"li6\\\"><span class=\\\"s4\\\">dan+doen+we+dat heeft zich ingespannen om met zorg deze gebruiksvoorwaarden op te stellen. Indien een of meer bepalingen van deze gebruiksvoorwaarden desondanks nietig zijn of vernietigd worden dan blijven de overige bepalingen onverminderd van kracht en dienen de nietige bepalingen vervangen te worden in rechtsgeldige bedingen. Deze moeten zoveel mogelijk aansluiten bij het oorspronkelijke doel van de betreffende bepalingen en ten gunste van dan+doen+we+dat strekken.<\\/span><\\/li>\\r\\n<\\/ol>\\r\\n<p>&nbsp;<\\/p>\",\"name\":\"core.rich-text-block\",\"nomobile\":\"1\"}',NULL),(1500,82,'widget','core.layout-column-width',1498,6,'{\"title\":\"\",\"columnWidth\":\"\",\"columnWidthType\":\"px\",\"nomobile