INSERT INTO `engine4_group_groups` VALUES (3,5,'Yoga','\r\nOp zoek naar manieren om te ontspannen en gezond te blijven. Herken je dit? Dan is yoga misschien iets voor jou.',10,1,1,0,200,6,'2020-04-01 19:39:02','2020-04-01 19:39:03',1,64,0,0,'everyone',NULL),(4,3,'Actief & Sportief','Voor een uitje vol actie en spanning ',13,1,1,0,207,8,'2020-04-02 14:58:15','2020-04-02 14:58:15',1,61,0,0,'everyone',NULL),(5,4,'Hiken & Wandelen','Hiken wordt gedaan door mensen die graag wandelen door de natuur. Hoewel het gaat om een -soms- pittige wandeling doe je het vooral voor je plezier. Hiken in de natuur is een van de leukste vormen van ontspanning.',13,1,1,0,214,10,'2020-04-02 17:00:19','2020-04-02 17:00:19',1,67,0,0,'everyone',NULL),(6,9,'Wandelen','Bewegen is gezond en wandelen is een manier om aan je dagelijkse beweging te werken. Samen wandelen is ook gezellig. Iedere avond, 2 keer per week of wanneer het uitkomt.\r\nMet de groep Wandelen is het mogelijk om altijd een wandeling in te plannen met anderen.\r\n\r\n\r\n',10,1,1,0,299,12,'2020-04-15 08:13:06','2020-04-15 08:17:59',2,62,0,0,'everyone',NULL),(7,1,'Vrijdagmiddagborrel','Geniet  van de start van het weekend, onder het genot van hapjes, drankjes en waanzinnige entertainment. Friday it is!',0,1,1,0,759,14,'2020-04-26 22:24:28','2020-04-26 22:24:29',1,0,0,0,'everyone','3');
