INSERT INTO `engine4_messages_messages` VALUES (1,1,1,'antwoord op u vraag mbt betaald lidmaatschap','Beste Testen van Platform, hoi Khadija,\r\n\r\n\r\nDe module payment gateway staat nog niet aan. Anders is het testen van het platform pas mogelijk bij betaling. Ik heb nu ingesteld dat iedereen gratis lid is voor 1 jaar.\r\nBij je profiel staat het abonnement dat je hebt: Straks kan je bij aanmelden een keus maken tussen lid worden voor een jaar of per maand.\r\n\r\nFree for 12 months \r\nPlan Expiry Date:2021-04-10\r\nLevelSubscription Days Left:361 Days\r\n\r\nzie foto bijlage:\r\n\r\nThanks alvast, en ik hoor graag alle vragen die je hebt.  :)','2020-04-13 16:03:30','album_photo',6),(2,1,9,'','Dank voor je antwoord. Attachment is duidelijk!','2020-04-15 08:08:27','',0),(3,1,1,'','Momenteel bezig om deze punten voor elkaar te krijgen. Developers die handig zijn met php via freelancer.nl etc zijn kijken naar de omvang en tijdsdruk. Het is in principe bijna hetzelfde als nmlk.nl (nieuwe mensen leren kennen)\r\n\r\nThanks alvast en groet, \r\n\r\n\r\n\r\nzie hieronder de functionaliteiten die nog moeten.\r\n\r\n• Minimum and maximum number of participants to be determined by the organizer, minimum 2 max 30 per organizer\r\n	• If the event is full, you will be placed on a waiting list\r\n	• If there is a place available (for example, someone signs off) you will be notified.\r\n	• I can replace participants from the waiting list with participants who have, for example, transferred their ticket or spot. (?)\r\n	• As a organizer I can reduce or increase the number of participants.\r\n	• Change/ adjusting participants list: A list of participants, can be adjusted (possibility to  remove/ change participant)\r\n	• only Admin can organizes events for several days\r\n	• Admin: can place event/ activity for more than 30 participants \r\n	• Activities organized by admin have more options, so admin can determine how many men and women for a 50% distribution, and activities can also be several days.\r\n	• notifications: for participants: eg: you are already participating in another event on that date / \r\n	• For organizer: minimum number of participants reached / maximum number of participants reached\r\n	• last minute notification push / email regarding activities that are recently created ( 3 days.) last minute events\r\n	• Ideal payment gateway\r\n	• Event list design without picture (for native app)\r\n	• Tickets sale regular member not included \r\n	• age category (?) / can be selected  if selected your own age category must be included in creating event\r\n	• Activity event choice for Gender: men and women / or for women, only women. and for men, only men.\r\n	• Details (address details location), meetingpoint, telephone organizer, and update info only visible for event participants','2020-04-15 17:41:54','',0),(4,1,9,'','Ik zag ook dat jullie Instagram hebben. Goed bezig! \r\n\r\nIk blijf nog even rondkijken en testen en zal later (als ik de site beter heb leren kennen) je mijn bevindingen mailen.\r\n\r\nGroet!','2020-04-16 07:44:13','',0);
