INSERT INTO `engine4_sesevent_events` VALUES (6,3,'Park Tennis','Tennis is één van de populairste en bekendste sporten ter wereld. Ook in Nederland heeft tennis een plek in ons sporthart veroverd. Ongeveer een miljoen Nederlanders staan regelmatig op de tennisbaan en er zijn er maar weinig die nog nooit een racket in de hand hebben gehad. Als tweede sport van Nederland is er bijna overal op fietsafstand wel een tennisbaan te vinden','park-tennis','2020-07-15 08:00:00','2020-07-16 09:30:00',70,0,'Europe/Berlin',0,'<p><strong>Contact via Parkmanager</strong><br><strong>Marjan Begemann</strong><br><br><a href=\"tel:+31626220360\"><strong>06 &ndash; 26 2203 60</strong></a><br>(di, wo en vrij tot 15.00 uur)</p>',0,NULL,152,NULL,151,0,'Tennisvereniging Beekhuizen, Beekhuizenseweg, Velp, Nederland','Tennisvereniging Beekhuizen','site',5,'user',3,0,1,5,0,0,1,0,'',NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,62,2,0,0,0,0,0,0,0,0,NULL,NULL,0,0,'31.20.183.91',1,'2020-03-30 22:03:19','2020-07-12 18:22:54',NULL,NULL,NULL,0,0,99,NULL,NULL,0,0,'Undistributed',0,0,0,NULL,NULL),(7,1,'Weekend Ardennen DennenHeuvel ','Dennenheuvel ','weekend-ardennen','2020-07-18 08:27:00','2020-07-20 08:27:00',76,0,'Europe/Berlin',0,NULL,0,NULL,139,NULL,NULL,0,'Vakantiedomein Dennenheuvel/ Domaine de vacances Mont-des-Pins, Mont des Pins, Durbuy, België','Dennenheuvel ','site',4,'user',1,0,1,0,0,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,47,3,0,0,0,0,1,0,0,0,'2020-04-01','2020-04-30',0,0,'31.20.183.91',1,'2020-03-30 22:29:52','2020-08-03 21:25:26',NULL,NULL,NULL,0,0,99,NULL,NULL,0,0,'Undistributed',0,0,0,NULL,NULL),(8,1,'Vissen','Ga je binnenkort een keer vissen maar weet je nog niet precies hoe je dat moet doen? We helpen je graag goed op weg! Als eerst is het belangrijk om een beetje te weten wat je wil vangen. Er zijn namelijk heel veel verschillende manieren van vissen en ook heel veel verschillende soorten vissen die je kan vangen. Vissen op roofvis doe je namelijk anders dan vissen op voorntjes of karper.','vissen','2020-07-06 08:52:00','2020-07-11 08:52:00',75,0,'Europe/Berlin',0,NULL,0,NULL,143,NULL,NULL,0,'Hondensportvereniging Rijk van Nijmegen, Staddijk, Nijmegen, Nederland','Honden sportvereniging Rijk van Nijmegen','site',4,'user',1,0,1,0,0,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,58,1,1,0,1,0,0,0,0,0,NULL,NULL,0,0,'31.20.183.91',1,'2020-03-30 22:55:44','2020-07-09 19:00:52',NULL,NULL,NULL,0,0,99,NULL,NULL,0,0,'Undistributed',0,0,0,NULL,NULL),(10,1,'Poolen toernooi','Pool bestaat uit meerdere spelsoorten, te weten 8-Ball, 9-Ball, 10-Ball en 14-1 (Straight Pool). Deze spelsoorten kunnen zowel individueel als in teamverband worden beoefend. Voor de leden worden diverse wedstrijden georganiseerd, zowel individueel als in teamverband.  Ook zijn er nog aanvullende spelsoorten zoals One Pocket en Bank Pool waarvan er ook officiele NK\'s plaatsvinden.\r\nZo vinden jaarlijks meerdere evenementen plaats voor de individuele speler, de Nationale Ranking en de NK\'s.\r\n\r\nVoor teams bestaat de mogelijkheid deel te nemen aan verschillende teamcompetities, zoals Ere-, eerste-, en tweede divisie en in diverse klasses die zowel regionaal als landelijk worden georganiseerd.\r\nDaarnaast organiseert de sectie Pool ook Nederlands kampioenschappen voor heren, dames, junioren en senioren.','poolen','2020-07-11 10:30:00','2020-07-11 17:00:00',70,0,'Europe/Berlin',0,NULL,0,NULL,167,NULL,NULL,0,'Koninklijke Nederlandse Biljart Bond, Archimedesbaan, Nieuwegein, Nederland','KNBB','site',4,'user',1,0,1,5,0,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,33,3,0,0,0,0,0,0,0,0,NULL,NULL,0,0,'31.20.183.91',1,'2020-03-31 19:25:44','2020-06-11 09:08:06',NULL,NULL,NULL,0,0,99,NULL,NULL,0,0,'Undistributed',0,0,0,NULL,NULL),(11,1,'House & Techno Classics ','Met TECHNO CLASSICS willen ze het clubgevoel van toen en nu weer opnieuw laten beleven. Deze editie is de 1ste in een reeks van 4 die dit jaar gepland staan. Het accent van de muziek ligt op TECHNO uit de jaren \'80, \'90 en \'OOs, maar ook hedendaagse pareltjes gaan voorbij komen en worden samengesmolten tot een mooie mix.\r\n\r\nDJ Dimitri, wie kent deze niet? In 1987 is hij begonnen in de legendarische Roxy in Amsterdam.\r\nDJ Pure, is een van de initiatiefnemers van Planet Rose, het internationaal Techno Podium van Nederland.\r\nHet feestje duurt tot 3.00 uur.\r\n\r\nEarly birds tickets, deze zijn al uitverkocht!\r\nNormale ticket 10 euro.\r\nKassa ticket 12.50.\r\n\r\nParkeren kan rondom het Honigcomplex en aan de straat.\r\n','house-techno-classics','2020-07-21 18:30:00','2020-07-21 21:30:00',74,0,'Europe/Berlin',0,'<p class=\"Intro_text\">Brebl ademt het idee dat iedereen die graag iets moois aan Nijmegen wil toevoegen de kans moet krijgen om daar op een laagdrempelige manier mee te starten. Inmiddels is Brebl een begrip en liggen bij recensenten de vergelijkingen met oude en nieuwe podia hoog in de pen. Brebl ademt nostalgie, levenslust en vernieuwing.</p>\r\n<p>&nbsp;</p>\r\n<h4>Cultuur is het hart van Brebl</h4>\r\n<p>Brebl is een afkorting van Broeien en bloeien (brebl&rsquo;n) en is de plek in Nijmegen voor nieuwe culturele initiatieven om te experimenteren en om uit te groeien tot iets groots dat zichtbaar is voor de stad en verder.</p>\r\n<p>Voel je welkom om de stad kleur te geven en je culturele vleugels uit te slaan!</p>\r\n<h4>Wat is er allemaal te doen?</h4>\r\n<p>Sowieso kan je elke woensdagavond en elke 3e zondagmiddag van de maand je oren strelen met jazz. Vrijwel elk weekend is er dance en dans in Brebl, soms klein, soms groot, soms tot laat, soms vanaf zeven, maar hoe dan ook fijn van sfeer en muziek. Daarnaast biedt de agenda je de snelweg naar salsa, po&euml;zie, lindyhop, pop en literatuur.</p>',0,NULL,171,NULL,175,0,'Brebl | de Cultuur Coöperatie, Waalbandijk, Nijmegen, Nederland','Brebl','site',4,'user',1,0,1,0,0,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,13,1,0,0,0,0,0,0,0,0,NULL,NULL,0,0,'31.20.183.91',1,'2020-03-31 19:43:49','2020-07-01 10:32:43',NULL,NULL,NULL,0,0,99,NULL,NULL,0,0,'Undistributed',0,0,0,NULL,NULL),(13,3,'De Generatie presents: Odyssey','meeslepende klanken de boventoon voeren. Laat de muzikale meesters je meenemen in deze Odyssey en verlies je besef van tijd. In deze avontuurlijke reis ervaar je hoe het is om onderdeel te zijn van een groep pure liefhebbers. Iedereen is welkom om zich op te laten nemen in de lange sets en te dansen als nooit tevoren. Wij zijn De Generatie. Jullie zijn De Generatie.\r\n\r\n','de-generatie-presents-odyssey','2020-07-30 05:45:00','2020-07-30 10:00:00',74,0,'Europe/Berlin',0,'<p><span style=\"font-family: terminal, monaco, monospace; font-size: 18pt;\"><strong>meeslepende klanken</strong> </span>de boventoon voeren. Laat de muzikale meesters je meenemen in deze Odyssey en verlies je besef van tijd. In deze avontuurlijke reis ervaar je hoe het is om onderdeel te zijn van een groep pure liefhebbers. Iedereen is welkom om zich op te laten nemen in de lange sets en te dansen als nooit tevoren. Wij zijn De Generatie. Jullie zijn De Generatie.meeslepende klanken de boventoon voeren. Laat de muzikale meesters je meenemen in deze Odyssey en verlies je besef van tijd. <span style=\"color: #ff6600; background-color: #33cccc;\"><strong><span style=\"font-family: symbol;\">In deze avontuurlijke reis ervaar je hoe het is om onderdeel te zijn van een groep pure liefhebbers. Iedereen is welkom om zich op te laten nemen in de lange sets en te dansen als nooit tevoren. Wij zijn De Generatie. Jullie zijn De Generatie.meeslepende klanken de boventoon voeren. Laat de muzikale</span> </strong></span>meesters je meenemen in deze Odyssey en verlies je besef van tijd. In deze avontuurlijke reis ervaar je hoe het is om onderdeel te zijn van een groep pure liefhebbers. Iedereen is welkom om zich op te laten nemen in de lange sets en te dansen als nooit t