arros) in Guarda, Celorico da Beira, Covilhã, Seia en Gouveia. ','stadswandeling-evora','2020-08-04 08:39:00','2020-08-09 08:39:00',76,0,'Europe/Berlin',0,NULL,0,NULL,NULL,NULL,NULL,0,'Centro de Interpretação da Batalha do Vimeiro, Rua do Monumento, Vimeiro, Portugal','','site',5,'user',3,0,1,0,0,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,18,1,0,0,0,0,0,0,0,0,NULL,NULL,0,0,'10.0.4.6',1,'2020-07-27 22:47:57','2020-08-03 19:34:44',NULL,NULL,NULL,0,0,200,NULL,NULL,0,0,'Undistributed',0,0,0,NULL,NULL),(36,1,'Aziatische keuken kookcursus','De Aziatische keuken is wellicht de meest uitgebreide keuken aanzien het om veel verschillende landen gaat. Daarvan hebben in de Aziatische kookworkshop deze drie heerlijke keukens uit gekozen. Deze kookcursus wordt gegeven in een van onze kookstudio’s in Amsterdam.','aziatische-keuken-kookcursus','2020-08-15 09:00:00','2020-08-15 13:30:00',71,0,'Europe/Berlin',0,NULL,0,NULL,861,NULL,NULL,0,'Club Cuisine, Nieuwmarkt, Amsterdam, Nederland','Club Cuisine','site',4,'user',1,0,1,0,0,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,1,0,0,0,0,0,0,0,0,NULL,NULL,0,0,'10.0.4.6',1,'2020-08-03 11:14:33','2020-08-03 11:14:33',NULL,NULL,NULL,0,0,99,NULL,NULL,0,0,'Undistributed',0,0,0,NULL,NULL),(37,1,'Mountainbiken','Bij ASC Olympia rijden we niet alleen op de weg of op de baan. We hebben een groot aantal leden die naast wielrennen of baanwielrennen heel regelmatig mountainbiken in Amsterdam. Of (cyclo)crossen. Daarvoor hebben we ons eigen mountainbike/cyclocross parcours aangelegd op Sportpark Sloten.\r\n\r\nAls je aan mountainbiken denkt, denk je vaak aan de in modder gedrenkte fietser, die in duizelingwekkende vaart over bijna onmogelijke obstakels vliegt of een groepje bikers die zo snel mogelijk een steile heuvel afvliegen. Hoewel mountainbiken erg uitdagend en niet zonder risico is, is het niet per se de ‘extreme sport’ die veel mensen denken dat het is. Mountainbiken is een echte familiesport. Voor een steeds groter wordende groep mountainbikers is deze tak van de wielersport een heel goede manier om actief op de fiets te zitten.','mountainbiken','2020-08-22 09:00:00','2020-08-22 14:00:00',70,0,'Europe/Berlin',0,NULL,0,NULL,865,NULL,869,0,'ASC Olympia, Sloterweg, Amsterdam, Nederland','ASC Olympia','site',4,'user',1,0,1,0,0,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,1,0,0,0,0,0,0,0,0,NULL,NULL,0,0,'10.0.4.6',1,'2020-08-03 11:27:09','2020-08-03 11:27:10',NULL,NULL,NULL,0,0,99,NULL,NULL,0,0,'Undistributed',0,0,0,NULL,NULL),(38,1,'Voor de beginnende kitesurfer','Voor de beginnende kitesurfer die graag eens wil proberen hoe het is om te kitesurfen bieden wij de introductie kitesurfles aan. Je leert over de veiligheid, het gebruik van de veiligheidssystemen, het optuigen van de kite, veilig besturen van de kite en gecontroleerd omgaan met de kracht van de kite. Dit door natuurlijk veel praktische oefeningen in het water zoals ‘bodydraggen’ met de kite (je laat je achter de kite aan door het water trekken). Dit geeft je een goed idee hoe het voelt om met de kite om te gaan en bereid je voor op je eerste waterstart poging met het board.\r\n\r\nMaximaal 2 studenten per instructeur bij groepsles. ','voor-de-beginnende-kitesurfer','2020-08-30 09:00:00','2020-08-30 12:00:00',70,0,'Europe/Berlin',0,NULL,0,NULL,870,NULL,NULL,0,'Kitesurfschool Kitearena, Boulevard Paulus Loot, Zandvoort, Nederland','Kitearena','site',4,'user',1,0,1,0,0,0,1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,15,1,0,0,0,0,0,0,0,0,NULL,NULL,0,0,'10.0.4.6',1,'2020-08-03 11:36:10','2020-08-03 11:36:11',NULL,NULL,NULL,0,0,99,NULL,NULL,0,0,'Undistributed',0,0,0,NULL,NULL),(39,5,'Bar Pif ','Bonjour en entrez-vous! Bij Bar Pif kan je neerstrijken voor lunch, diner en nachtelijke cravings, of gewoon een drankje. Benen omhoog of onder tafel.','bar-pif','2020-08-31 14:00:00','2020-08-31 18:00:00',72,0,'Europe/Berlin',0,NULL,0,NUL