evestigd en in de Kamer van koophandel ingeschreven onder nummer:&nbsp;<\\/span><span class=\\\"s1\\\">nr: &mdash;&mdash;&mdash;&mdash;&mdash;&mdash;<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">1.2. In deze voorwaarden wordt verstaan onder:<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><br><\\/span><span class=\\\"s1\\\">dan+doen+we+dat-website:<br><\\/span><span class=\\\"s1\\\">de website onder de domeinnaam: www.dandoenwedat.com <\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">dan+doen+we+dat-er:<br><\\/span><span class=\\\"s1\\\">Jij die deelneemt aan events en\\/of bij betaling van het dan+doen+we+dat-lidmaatschap van de website van dan+doen+we+dat gebruik maakt dan wel daar toegang toe heeft.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Introduc&eacute; van een dan+doen+we+dat-er:<br><\\/span><span class=\\\"s1\\\">Degene die als introduc&eacute; van een dan+doen+we+dat-er alleen deel kan nemen aan een dan+doen+we+dat-teamactiviteit.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Je, jij, jou(w) of jezelf:<br><\\/span><span class=\\\"s1\\\">dan+doen+we+dat-er of introduc&eacute;, dan wel twee of alle voorgenoemde personen, afhankelijk van degene op wie het&nbsp;<\\/span><span class=\\\"s1\\\">artikel - al dan niet uit de context van het artikel op te maken - van toepassing is.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Event:<br><\\/span><span class=\\\"s1\\\">Een enkel- of meervoudige actieve bezigheid die op de dan+doen+we+dat-website voor dan+doen+we+dat-ers vrijblijvend worden opgezet om te ondernemen met als doel om op een actieve en ontspannen&nbsp;manier deel te nemen aan activiteiten en events. Daaronder&nbsp;<\\/span><span class=\\\"s1\\\">vallen onder meer feest- en uitgaansactiviteiten, sportieve en avontuurlijke events, kunst en cultuur, body&nbsp;<\\/span><span class=\\\"s1\\\">en mind, persoonlijke ontwikkeling, andere diensten of faciliteiten en\\/of het gebruik van materialen,&nbsp;<\\/span><span class=\\\"s1\\\">maaltijden en drank met dag- en\\/of nachtverblijf in binnen- of buitenland. Vervoer van en naar de plaats&nbsp;<\\/span><span class=\\\"s1\\\">van event valt daar nooit onder.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Event opgezet door en voor dan+doen+we+dat-ers onderling:<br><\\/span><span class=\\\"s1\\\">een event, zoals op de dan+doen+we+dat-website staat vermeld en die door een of meerdere dan+doen+we+dat-ers zijn opgezet<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">om samen te ondernemen om elkaar te leren kennen. De organiserende dan+doen+we+dat-er is bij het event&nbsp;<\\/span><span class=\\\"s1\\\">herkenbaar aan zijn\\/haar foto met zijn\\/haar naam met daaronder de vermelding \'organisator\'. \'host\'<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">dan+doen+we+dat-teamactiviteit:<br><\\/span><span class=\\\"s1\\\">een dan+doen+we+dat-event die is opgezet door het dan+doen+we+dat-team (redactie) en welke&nbsp;<\\/span><span class=\\\"s1\\\">op locatie voor deelname aan dan+doen+we+dat-ers wordt aangeboden.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><strong><span class=\\\"s1\\\">2. Werkingssfeer en totstandkoming van het dan+doen+we+dat-lidmaatschap<\\/span><\\/strong><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">2.1. Deze gebruiksvoorwaarden zijn van toepassing op alle dan+doen+we+dat events en de daarmee verbandhoudende acties van d<\\/span><span class=\\\"s1\\\">an+doen+we+dat, aanbiedingen en overeenkomsten gedaan door of namens dan+doen+we+dat aan een dan+doen+we+dat-er, tenzij dit anders op&nbsp;<\\/span><span class=\\\"s1\\\">de website van dan+doen+we+dat is aangegeven.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">2.2. Door inschrijving via de dan+doen+we+dat-website, betaling en na ontvangst van een bevestiging in jouw dan+doen+we+dat-inbox komt&nbsp;<\\/span><span class=\\\"s1\\\">een overeenkomst van (proef)deelnemerschap met dan+doen+we+dat tot stand. Door inschrijving via de dan+doen+we+dat-website en&nbsp;<\\/span><span class=\\\"s1\\\">door de dan+doen+we+dat-website te gebruiken aanvaardt je dat deze gebruiksvoorwaarden van toepassing zijn en alle&nbsp;<\\/span><span class=\\\"s1\\\">voorwaarden die daarin zijn opgenomen. Daaronder vallen ook de voorwaarden (van anderen dan dan+doen+we+dat)&nbsp;<\\/span><span class=\\\"s1\\\">waarnaar (al dan niet door een hyperlink) wordt verwezen en\\/of die elders op de dan+doen+we+dat- website staan dan wel die&nbsp;<\\/span><span class=\\\"s1\\\">staan op de website waar bij het event via een hyperlink naar wordt verwezen. Al deze voorwaarden worden door&nbsp;<\\/span><span class=\\\"s1\\\">jou voor akkoord verklaard door inschrijving via de dan+doen+we+dat-website. Je verklaart je uitdrukkelijk bekend met de&nbsp;<\\/span><span class=\\\"s1\\\">werking van hyperlinken en dat door deze aan te klikken een nieuw gedeelte van een website is te zien met&nbsp;<\\/span><span class=\\\"s1\\\">daarop mogelijk voor het event relevante (contracts)informatie. Bij eventuele strijdigheden met de&nbsp;<\\/span><span class=\\\"s1\\\">gebruiksvoorwaarden of voorwaarden van het event gaat de uitleg voor die strekt ten gunste van dan+doen+we+dat.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">2.3. De gebruiksvoorwaarden kunnen steeds door dan+doen+we+dat worden gewijzigd of aangevuld. Eventuele&nbsp;<\\/span><span class=\\\"s1\\\">wijzigingen of aanvullingen worden op de website van dan+doen+we+dat aangegeven. Steeds geldt de laatste op de&nbsp;<\\/span><span class=\\\"s1\\\">website geplaatste versie van de gebruiksvoorwaarden vanaf het moment dat deze op de website staat&nbsp;<\\/span><span class=\\\"s1\\\">vermeld. Je verplicht je de dan+doen+we+dat-website regelmatig te controleren of er zich wijzigingen in de&nbsp;<\\/span><span class=\\\"s1\\\">gebruiksvoorwaarden hebben voorgedaan en verklaart je met eventuele wijzigingen akkoord.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><strong><span class=\\\"s1\\\">3. dan+doen+we+dat-lidmaatschap<\\/span><\\/strong><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">3.1. Je hebt als dan+doen+we+dat-er een eigen dan+doen+we+dat-profielpagina met dan+doen+we+dat-inbox. Je dient daarnaast te beschikken over een&nbsp;<\\/span><span class=\\\"s1\\\">operationeel email-adres.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">3.2. Je hebt de keuze of je een heel jaar aan dan+doen+we+dat-lidmaatschap wilt betalen. Het dan+doen+we+dat-lidmaatschap duurt dan&nbsp;<\\/span><span class=\\\"s1\\\">ook een respectievelijk een jaar. Het dan+doen+we+dat-lidmaatschap wordt niet automatisch na ommekomst van <\\/span><span class=\\\"s1\\\">een jaar respectievelijk verlengd.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">3.3. Bij inschrijving via de dan+doen+we+dat-website en aanmelding voor de eerste event ben je automatisch&nbsp;lid.&nbsp;<\\/span><span class=\\\"s1\\\">Inschrijving en aanmelding voor events vinden uitsluitend via de website plaats. <\\/span><span class=\\\"s1\\\"> Na deelname aan een event gelden de gangbare tarieven voor het dan+doen+we+dat-lidmaatschap bij&nbsp;<\\/span><span class=\\\"s1\\\">aanmelding voor volgende events.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">3.4. Je kan als dan+doen+we+dat-er een vriend\\/vriendin uitnodigen als introduc&eacute; alleen voor deelname aan een d<\\/span><span class=\\\"s1\\\">an+doen+we+dat-teamactiviteit. Een introduc&eacute; aanmelden doe je bij jouw aanmelding van de betreffende event of reis. Als d<\\/span><span class=\\\"s1\\\">an+doen+we+dat-er ben je volledig aansprakelijk voor jouw introduc&eacute; voor alle verplichtingen die na aanmelding voor het&nbsp;<\\/span><span class=\\\"s1\\\">event uit het dan+doen+we+dat-lidmaatschap voortvloeien, waaronder die uit de&nbsp; gebruiksvoorwaarden. Alle communicatie en&nbsp;<\\/span><span class=\\\"s1\\\">betalingen verlopen via jou als dan+doen+we+dat-er. Je vrijwaart dan+doen+we+dat volledig voor eventuele aanspraken van jouw&nbsp;<\\/span><span class=\\\"s1\\\">introduc&eacute; jegens dan+doen+we+dat.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">3.5. Be&euml;indiging van de deelname aan dan+doen+we+dat is eenvoudig mogelijk door dat zelf met twee klikken te doen in de eigen&nbsp;<\\/span><span class=\\\"s1\\\">profielpagina. Hierbij vindt onder geen beding restitutie plaats van reeds betaalde bedragen.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">3.6. dan+doen+we+dat behoudt zich het recht voor zonder voorafgaande aankondiging tarieven of inschrijvingsvereisten te&nbsp;<\\/span><span class=\\\"s1\\\">wijzigen.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">3.7. <\\/span><span class=\\\"s1\\\"> Na aanmelding kan dan+doen+we+dat je zonder opgave van redenen weigeren het d<\\/span><span class=\\\"s1\\\">an+doen+we+dat-lidmaatschap te verlenen. dan+doen+we+dat kan je op elk moment verzoeken om een identificatiebewijs te tonen. Indien je&nbsp;<\\/span><span class=\\\"s1\\\">daaraan niet voldoet, heeft dan+doen+we+dat het recht zonder restitutie van gelden de toegang tot een event te weigeren en&nbsp;<\\/span><span class=\\\"s1\\\">het dan+doen+we+dat-lidmaatschap te be&euml;indigen.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">3.8. Deelname aan dan+doen+we+dat is persoonlijk en niet overdraagbaar. Het is niet toegestaan meerdere keren in verschillende&nbsp;<\\/span><span class=\\\"s1\\\">hoedanigheden in te inschrijven en\\/of het login en paswoord over te dragen aan een derde.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">3.9. Je stemt er mee in dat de dan+doen+we+dat-website bestanden, afbeeldingen, foto&rsquo;s, andere content en programma&rsquo;s bevat&nbsp;<\\/span><span class=\\\"s1\\\">die eigendom van dan+doen+we+dat zijn, licentiegevers en\\/of gebruikers van dan+doen+we+dat en die beschermd worden door&nbsp;<\\/span><span class=\\\"s1\\\">toepasselijke intellectuele eigendomsrechten, waaronder (maar niet beperkt tot) auteursrechten, merken en&nbsp;<\\/span><span class=\\\"s1\\\">octrooien. Je verklaart geen handelingen te zullen verrichten die inbreuk kunnen maken op de (intellectuele&nbsp;<\\/span><span class=\\\"s1\\\">eigendom) rechten van dan+doen+we+dat of derden. Je erkent en aanvaardt dat enig ongeoorloofd gebruik van bestanden,&nbsp;<\\/span><span class=\\\"s1\\\">gegevens en materialen waarop intellectuele eigendomsrechten rusten, inbreuk maakt op deze voorwaarden en&nbsp;<\\/span><span class=\\\"s1\\\">op de toepasselijke wetgeving, waaronder maar niet beperkt tot de Auteurswet.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><strong><span class=\\\"s1\\\">4. Algemeen en events opgezet door dan+doen+we+dat-ers<\\/span><\\/strong><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">4.1. Je kunt als dan+doen+we+dat-er events voor deelname opzetten voor andere dan+doen+we+dat-ers. Deelname aan events opgezet door d<\\/span><span class=\\\"s1\\\">an+doen+we+dat-ers is geheel vrijblijvend. Deelname vindt plaats door aanmelding via de dan+doen+we+dat-website. Het opzetten van&nbsp;<\\/span><span class=\\\"s1\\\">commerci&euml;le events is niet toegestaan. Commerci&euml;le events zijn events die voor de organiserende dan+doen+we+dat-er&nbsp;<\\/span><span class=\\\"s1\\\">resulteren in financieel of ander gewin, een en ander naar uitsluitend oordeel van dan+doen+we+dat.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">4.2. Aan de events kunnen beperkingen of voorwaarden worden verbonden (door bijvoorbeeld een leeftijdseis te&nbsp;<\\/span><span class=\\\"s1\\\">stellen. Aan de omschrijving of de schatting van kosten kunnen geen rechten jegens dan+doen+we+dat worden ontleend. Bij&nbsp;<\\/span><span class=\\\"s1\\\">het opzetten van events ben je verplicht je te houden aan de spelregels. Deze <strong>spelregels staan bij punt 11.3<\\/strong><\\/span><strong><span class=\\\"s1\\\">.<\\/span><\\/strong><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">4.3. De eventuele kosten verbonden aan een dan+doen+we+dat-event, zijn steeds voor eigen rekening van jou als dan+doen+we+dat-er of&nbsp;<\\/span><span class=\\\"s1\\\">introduc&eacute;.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">4.4. dan+doen+we+dat reguleert het onderlinge contact tussen dan+doen+we+dat-ers en proefleden niet. Eventuele gemaakte onderlinge&nbsp;<\\/span><span class=\\\"s1\\\">afspraken blijven steeds afspraken gemaakt in het sociale verkeer.<\\/span><span class=\\\"s1\\\">&nbsp;Daaraan zijn geen rechten jegens dan+doen+we+dat te ontlenen. Deelname is voor 100 % eigen risico.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">4.5. dan+doen+we+dat heeft altijd het recht beperkingen of voorwaarden aan de voorgestelde event te verbinden of deze -zonder&nbsp;<\\/span><span class=\\\"s1\\\">opgave van redenen en ongeacht de voorgestelde prijs- te weigeren te plaatsen. dan+doen+we+dat-teamactiviteiten hebben&nbsp;<\\/span><span class=\\\"s1\\\">altijd voorrang op door dan+doen+we+dat-ers opgezette events. Events die&nbsp;<\\/span><span class=\\\"s1\\\">overeenkomen, concurreren of conflicteren met nieuwe of bestaande (terugkerende) events onder het&nbsp;dan+doen+we+dat-logo&nbsp;<\\/span><span class=\\\"s1\\\">kunnen door dan+doen+we+dat zonder opgave van reden worden geweigerd. Het is niet toegestaan events op te zetten bij&nbsp;<\\/span><span class=\\\"s1\\\">bedrijven die een partnerprofiel hebben of bij bedrijven of personen, die daaraan op enige wijze (zoals bijvoorbeeld&nbsp;<\\/span><span class=\\\"s1\\\">onderdeel uitmakende van een groep) zijn gelieerd, het een en ander naar het uitsluitend oordeel van dan+doen+we+dat.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><strong><span class=\\\"s1\\\">5. Gedragsregels<\\/span><\\/strong><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">5.1. Je verklaart je als dan+doen+we+dat-er geen berichten te zullen plaatsen of versturen die beledigend, grof, bedreigend,&nbsp;<\\/span><span class=\\\"s1\\\">obsceen zijn of die in strijd zijn met wet- of regelgeving.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">5.2. Je verklaart je als dan+doen+we+dat-er geen berichten te zullen plaatsen of versturen die beledigend, grof, bedreigend,&nbsp;<\\/span><span class=\\\"s1\\\">obsceen zijn of die in strijd zijn met wet- of regelgeving. Je verklaart dan+doen+we+dat op geen enkele wijze te zullen&nbsp;<\\/span><span class=\\\"s1\\\">gebruiken voor het adverteren van diensten of producten, noch te zullen aanwenden voor welke vorm van&nbsp;<\\/span><span class=\\\"s1\\\">commerci&euml;le doelen dan ook.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">5.3. Je verklaart informatie verkregen uit de dan+doen+we+dat-website van welke aard dan ook niet elders te publiceren zonder&nbsp;<\\/span><span class=\\\"s1\\\">voorafgaand toestemming te hebben verkregen van dan+doen+we+dat.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">5.4. Je stemt ermee persoonlijk verantwoordelijk te zijn voor wat op de dan+doen+we+dat-website wordt gepubliceerd, alsmede&nbsp;<\\/span><span class=\\\"s1\\\">voor de interacties met andere deelnemers via de dan+doen+we+dat-website en tijdens events. Je stemt ermee in niet&nbsp;<\\/span><span class=\\\"s1\\\">moedwillig conflicten met andere deelnemers uit te lokken of te stimuleren.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">5.5. Pogingen tot inbraak of inbraak in de database van dan+doen+we+dat zijn verboden en onrechtmatig. Voor medeplichtigheid&nbsp;<\\/span><span class=\\\"s1\\\">of kennis hebbende van derden met pogingen tot inbraak of inbraak in de database van dan+doen+we+dat geldt hetzelfde.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">5.6. Niet-nakoming of een handelen of nalaten in strijd met voorgaande leden staat op straffe van onmiddellijke&nbsp;<\\/span><span class=\\\"s1\\\">be&euml;indiging van het dan+doen+we+dat-lidmaatschap, zonder dat een recht op restitutie van betaalde gelden bestaat. Dit laat&nbsp;<\\/span><span class=\\\"s1\\\">onverlet het recht van dan+doen+we+dat op volledige schadevergoeding bij ontstane schade.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><strong><span class=\\\"s1\\\">6. dan+doen+we+dat-teamactiviteit<\\/span><\\/strong><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">6.1. Aanmelding voor en uitvoering van de dan+doen+we+dat-teamactiviteiten vindt plaats onder de voorwaarden zoals bij het&nbsp;<\\/span><span class=\\\"s1\\\">event omschreven en\\/of zoals op andere wijze is aangegeven. dan+doen+we+dat-teamactiviteiten kunnen door&nbsp; dan+doen+we+dat zijn&nbsp;<\\/span><span class=\\\"s1\\\">opgezet, maar door andere bedrijven worden uitgevoerd. Steeds gelden de specifieke bij het event beschreven&nbsp;<\\/span><span class=\\\"s1\\\">voorwaarden. Vervoer van en naar een specifieke locatie wordt nimmer door dan+doen+we+dat verzorgd. Aanmelding voor de d<\\/span><span class=\\\"s1\\\">an+doen+we+dat-teamactiviteit heeft te gelden als onherroepelijke boeking van het event. Betaling dient bij de aanmelding&nbsp;<\\/span><span class=\\\"s1\\\">van het event plaats te vinden, tenzij anders is aangegeven.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">6.2. Bij afmelding van dan+doen+we+dat-teamactiviteiten door jou of een introduc&eacute; worden reeds betaalde gelden niet&nbsp;<\\/span><span class=\\\"s1\\\">gerestitueerd.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">6.3. Bij dan+doen+we+dat-teamactiviteiten heeft dan+doen+we+dat het recht het event te annuleren of te wijzigen wegens gewichtige redenen&nbsp;<\\/span><span class=\\\"s1\\\">zonder dat dan+doen+we+dat in redelijkheid aan uitvoering kan worden gehouden. Ook in geval van overmacht is dan+doen+we+dat niet&nbsp;<\\/span><span class=\\\"s1\\\">gehouden het event uit te voeren. Onder overmacht wordt verstaan abnormale of onvoorzienbare omstandigheden&nbsp;<\\/span><span class=\\\"s1\\\">die onafhankelijk zijn van de wil van dan+doen+we+dat en waarvan de gevolgen ondanks voorzorgsmaatregelen niet konden&nbsp;<\\/span><span class=\\\"s1\\\">worden vermeden.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">6.4. Een aanmelding voor een voorgestelde dan+doen+we+dat-teamactiviteit is overdraagbaar aan een andere dan+doen+we+dat-er of zijn of&nbsp;<\\/span><span class=\\\"s1\\\">haar introduc&eacute;, tenzij anders in de omschrijving van het event is aangegeven.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><strong><span class=\\\"s1\\\">7. Event opgezet onder een partnerprofiel<\\/span><\\/strong><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">7.1. Events opgezet onder het partnerprofiel worden vrijblijvend voor deelname door het betreffende bedrijf&nbsp;<\\/span><span class=\\\"s1\\\">aangeboden. Via de website van dan+doen+we+dat kun je als dan+doen+we+dat-er voor deelname aan het event opgezet door het bedrijf&nbsp;<\\/span><span class=\\\"s1\\\">aanmelden. Het bedrijf is zelf verantwoordelijk voor de omschrijving en de uitvoering van het event en het&nbsp;<\\/span><span class=\\\"s1\\\">verschaffen van volledige informatie daarover en het stellen van voorwaarden verbonden aan het event.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">7.2. Het event opgezet onder een partnerprofiel wordt nimmer door dan+doen+we+dat uitgevoerd maar volledig verzorgd door het&nbsp;<\\/span><span class=\\\"s1\\\">betreffende bedrijf. dan+doen+we+dat geeft het bedrijf slechts gelegenheid te adverteren met het event. dan+doen+we+dat is nimmer&nbsp;<\\/span><span class=\\\"s1\\\">contracts-partij bij een gesloten overeenkomst tussen het bedrijf en de dan+doen+we+dat-er. Voor zover er een overeenkomst&nbsp;<\\/span><span class=\\\"s1\\\">tot uitvoering van het event tot stand, komt deze uitsluitend tussen jou als dan+doen+we+dat-er en het bedrijf tot stand. dan+doen+we+dat&nbsp;<\\/span><span class=\\\"s1\\\">is niet verantwoordelijk jegens de dan+doen+we+dat-er en sluit elke aansprakelijk in de meest ruime zin uit voor geleden of te&nbsp;<\\/span><span class=\\\"s1\\\">lijden schade dan wel anderszins aangaande het event opgezet door het bedrijf. dan+doen+we+dat is geen hulppersoon in de&nbsp;<\\/span><span class=\\\"s1\\\">zin van de wet en biedt geen enkele garantie dat het bedrijf dat het event heeft opgezet het event correct, tijdig of&nbsp;<\\/span><span class=\\\"s1\\\">volledig uitvoert. Met al je eventuele aanspraken van niet, geen tijdige of onvolledige nakoming of ontstane schade&nbsp;<\\/span><span class=\\\"s1\\\">verband-houdende met de uitvoering van het event dien je als dan+doen+we+dat-er steeds uitsluitend en rechtstreeks te&nbsp;<\\/span><span class=\\\"s1\\\">wenden tot het bedrijf dat het event heeft opgezet of diens vertegenwoordiger. Wat betreft de verschafte informatie&nbsp;<\\/span><span class=\\\"s1\\\">over de aangeboden event is dan+doen+we+dat afhankelijk van het bedrijf dat het event onder partnerprofiel heeft opgezet.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">dan+doen+we+dat sluit elke aansprakelijk uit voor enigerlei schade die wordt ondervonden door onjuistheden of&nbsp;<\\/span><span class=\\\"s1\\\">onvolledigheden in de informatie en\\/of data afkomstig van het bedrijf.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\"><strong><span class=\\\"s1\\\">8. Aansprakelijkheid<\\/span><\\/strong><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">8.1. Deelname aan alle events is altijd 100 % voor eigen risico van jou als dan+doen+we+dat-er of jouw introduc&eacute;.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Behoudens opzet of grove schuld is dan+doen+we+dat niet aansprakelijk voor enige vorm van schade, waaronder&nbsp;<\\/span><span class=\\\"s1\\\">gevolgschade die een dan+doen+we+dat-er lijdt of zal lijden als gevolg van ongevallen of gebeurtenissen tijdens of&nbsp;<\\/span><span class=\\\"s1\\\">rond een event (al dan niet door gebruik van (ingehuurde) materialen of andere hulpzaken). dan+doen+we+dat is&nbsp;<\\/span><span class=\\\"s1\\\">nimmer aansprakelijk voor schade die voortvloeit uit of verband houdt met gebruik van de website of de&nbsp;<\\/span><span class=\\\"s1\\\">onmogelijkheid om deze te gebruiken en\\/of enige andere dienstverlening van dan+doen+we+dat dan uit onrechtmatige&nbsp;<\\/span><span class=\\\"s1\\\">daad of anderszins. dan+doen+we+dat is in ieder geval niet aansprakelijk voor schade die het gevolg is van:<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">1. omstandigheden die zijn toe te rekenen aan jou als dan+doen+we+dat-er of jouw introduc&eacute;, zoals het niet&nbsp;<\\/span><span class=\\\"s1\\\">hebben van een noodzakelijk reisdocument, een ontoereikend gezondheid of conditie, een ontoereikende persoonlijke uitrusting, onjuist handelen of niet-handelen, overschatting van de eigen vermogens of het negeren van instructies, en\\/of;<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">2. handelingen, nalatigheden en invloeden van direct of niet direct bij de uitvoering van de overeenkomst betrokken derden of&nbsp; hulppersonen.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">8.2. dan+doen+we+dat is nimmer aansprakelijk voor vermissing, verduistering of diefstal of schade, direct of indirect van of aan&nbsp;<\\/span><span class=\\\"s1\\\">goederen van dan+doen+we+dat-ers, proefleden of introduc&eacute;s.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">8.3. In het geval de dan+doen+we+dat-website niet beschikbaar is door technische storingen, waaronder begrepen storingen in&nbsp;<\\/span><span class=\\\"s1\\\">netwerkverbindingen, door dan+doen+we+dat gebruikte servers of software, bestaat geen recht op restitutie van reeds&nbsp;<\\/span><span class=\\\"s1\\\">betaalde gelden en is iedere aansprakelijkheid van dan+doen+we+dat voor schade uitgesloten.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">8.4. Bij overmacht of ingeval van een tekortkoming die niet kon worden voorzien of worden verholpen is&nbsp;<\\/span><span class=\\\"s1\\\">aansprakelijkheid uitgesloten. Je verplicht je als dan+doen+we+dat-er - evenals voor jouw introduc&eacute; - per event in de zin van&nbsp;<\\/span><span class=\\\"s1\\\">deze gebruiksvoorwaarden een passende ongevallen-, reis- en annuleringsverzekering af te sluiten. dan+doen+we+dat sluit e<\\/span><span class=\\\"s1\\\">lke aansprakelijkheid uit voor schade, waarvoor aanspraak op de vergoeding bestaat of geacht wordt te bestaan&nbsp;<\\/span><span class=\\\"s1\\\">op grond van eerdergenoemde verzekeringen.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">8.5. Je verplicht je als dan+doen+we+dat-er - evenals voor jouw introduc&eacute; - per event in de zin van deze gebruiksvoorwaarden een passende ongevallen-, reis- en annuleringsverzekering af te sluiten. dan+doen+we+dat sluit elke aansprakelijkheid uit voor&nbsp;<\\/span><span class=\\\"s1\\\">schade, waarvoor aanspraak op de vergoeding bestaat of geacht wordt te bestaan op grond van eerdergenoemde&nbsp;<\\/span><span class=\\\"s1\\\">verzekeringen.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">8.6. De in deze gebruiksvoorwaarden opgenomen uitsluitingen en beperkingen gelden ook ten behoeve van voor d<\\/span><span class=\\\"s1\\\">an+doen+we+dat op vrijwillige basis werkzame personen of eventuele medewerkers van dan+doen+we+dat.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">8.7. Er geldt een vervaltermijn van een jaar voor ieder uit de overeenkomst met jou als dan+doen+we+dat-er\\/introduc&eacute; en dan+doen+we+dat voortvloeiend vorderingsrecht.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">8.8. dan+doen+we+dat aanvaardt geen aansprakelijkheid voor hinderlijk gedrag van derden of enig ander uit het contact tussen&nbsp;<\\/span><span class=\\\"s1\\\">deelnemers onderling voortvloeiend ongemak. dan+doen+we+dat sluit ook alle aansprakelijkheid uit voor het gebruik door&nbsp;<\\/span><span class=\\\"s1\\\">derden van door een dan+doen+we+dat-er gepubliceerde persoonlijke informatie op de dan+doen+we+dat-website. Dat geldt eveneens voor aansprakelijkheid voor de daden of nalatigheden van andere dan+doen+we+dat ers\\/ proefleden\\/ introduc&eacute;s, in welke vorm dan ook.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">8.9. Indien zich bij een event onverhoopt een schadeveroorzakende gebeurtenis voordoet, die tot aansprakelijkheid van dan+doen+we+dat jegens jou als dan+doen+we+dat-er of jouw introduc&eacute; leidt, zal de aansprakelijkheid steeds beperkt zijn tot het laagste bedrag van de bedragen vermeld onder sub a dan wel b:<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">a) het maximumbedrag waarop de door dan+doen+we+dat gesloten aansprakelijkheidsverzekering dekking biedt.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Indien deze geen dekking biedt vindt ook geen vergoeding op grond van sub b plaats;<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">b) indien en voorzover sprake mocht zijn van een gesloten overeenkomst in de zin van de wet tussen jou\\/jouw introduc&eacute; en dan+doen+we+dat en voorzover de reis of de geboekte event niet door Dan+doen+we+dat wordt uitgevoerd,&nbsp;<\\/span><span class=\\\"s1\\\">is in geval van een toerekenbaar tekortschieten van dan+doen+we+dat op grond van de reisovereenkomst elke&nbsp;<\\/span><span class=\\\"s1\\\">aansprakelijkheid van dan+doen+we+dat beperkt tot vergoeding van andere schade (dan veroorzaakt door dood of&nbsp;<\\/span><span class=\\\"s1\\\">letsel) tot maximaal een bedrag van driemaal de reissom en bij gederfd reisgenot tot eenmaal de reissom.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Onder geen beding is dan+doen+we+dat een hulppersoon in de zin van de wet en in die hoedanigheid aansprakelijk.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Indien een internationaal verdrag van toepassing is, is de aansprakelijkheid van dan+doen+we+dat uitgesloten of&nbsp;<\\/span><span class=\\\"s1\\\">beperkt overeenkomstig dat verdrag.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><strong><span class=\\\"s1\\\">9. Rechten van dan+doen+we+dat<\\/span><\\/strong>&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">9.1. dan+doen+we+dat behoudt zich het recht voor je (proef) dan+doen+we+dat-lidmaatschap te be&euml;indigen en\\/of je en\\/of jouw introduc&eacute; van deelname aan events uit te sluiten, indien je gedrag, lichamelijke of geestelijke beperkingen of een andere&nbsp;<\\/span><span class=\\\"s1\\\">omstandigheid daartoe aanleiding geeft. dan+doen+we+dat is daartoe echter op geen enkele wijze verplicht, noch&nbsp;&nbsp;<\\/span><span class=\\\"s1\\\">verantwoordelijk. dan+doen+we+dat is dan niet gehouden tot restitutie van gelden en heeft onverminderd het recht op&nbsp;<\\/span><span class=\\\"s1\\\">volledige schadevergoeding bij eventueel ontstane schade.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">9.2. Je bent als dan+doen+we+dat-er jegens dan+doen+we+dat aansprakelijk voor schade of enig ander nadeel dat wordt veroorzaakt door het doen of nalaten van jezelf, of door jou toegelaten introduc&eacute;s of derden. Je vrijwaart dan+doen+we+dat volledig van aanspraken van anderen.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">9.3. dan+doen+we+dat behoudt zich het recht voor om door jouw gepubliceerde berichten aan te passen of geheel of gedeeltelijk te verwijderen indien dit passend of noodzakelijk wordt geacht.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">9.4. dan+doen+we+dat reguleert de communicatie tussen dan+doen+we+dat-ers\\/proefleden niet inhoudelijk, maar behoudt zich het recht voor om berichtenverkeer binnen dan+doen+we+dat in te zien om daarmee klachten na te kunnen trekken.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">9.5. dan+doen+we+dat is gerechtigd om je de toegang tot dan+doen+we+dat geheel of gedeeltelijk te ontzeggen.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">9.6. De overeenkomst van dan+doen+we+dat-lidmaatschap kan met onmiddellijke ingang worden ontbonden c.q. worden opgezegd indien dan+doen+we+dat-ers\\/proefleden informatie verzwijgen, verspreiden of andere events ontplooien die het bestaansrecht of de voortgang van dan+doen+we+dat bedreigen, zonder restitutie van gelden. Ontbinding c.q. opzegging vindt plaats door opheffing van de dan+doen+we+dat-profielpagina en dan+doen+we+dat-inbox of door blokkering van de toegang tot de dan+doen+we+dat-website.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><strong><span class=\\\"s1\\\">10 Privacy<\\/span><\\/strong><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">10.1<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">dan+doen+we+dat verwerkt je (privacy) gegevens alleen in verband met de faciliteiten die dan+doen+we+dat biedt en met geen ander doel dan om het mogelijk te maken om deel te nemen. Door akkoord te gaan met de gebruiksvoorwaarden geef je uitdrukkelijk toestemming voor gebruik van jouw persoonsgegevens, voor zover toestemming vereist zou zijn.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">10.2<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Profielen zijn van zoekmachines afgeschermd en niet door gastbezoekers van de website te zien. Profielgegevens worden door dan+doen+we+dat nooit aan derden verstrekt of overgedragen, tenzij een bevoegde instantie daarom verzoekt of dit verband houden met de faciliteiten die dan+doen+we+dat biedt.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">10.3<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Als je je aanmeldt voor een event is het plaatsen van een tekstreactie niet verplicht. Als je aanmeldt zonder tekstreactie dan vormt je foto (klein), voornaam en woonplaats onderdeel uit van bij het event roterende foto&rsquo;s van andere deelnemers. Deze is slechts enkele seconden te zien. Een eventuele tekstreactie -die dus niet verplicht is met foto, voornaam en plaatsnaam is voor gastbezoekers alleen bij dan+doen+we+dat team-activeiten en bij oude events te zien, net als mogelijk eventuele foto&rsquo;s of filmpjes die door dan+doen+we+dat-ers worden geplaatst. dan+doen+we+dat biedt de mogelijkheid om na aanmelding voor het event een reactie te plaatsen die uitsluitend voor deelnemers aan het event zichtbaar is.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><strong><span class=\\\"s1\\\">11. Overige<\\/span><\\/strong><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">11.1<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">dan+doen+we+dat heeft zich ingespannen om met zorg deze gebruiksvoorwaarden op te stellen. Indien een of meer bepalingen van deze gebruiksvoorwaarden desondanks nietig zijn of vernietigd worden dan blijven de overige bepalingen onverminderd van kracht en dienen de nietige bepalingen vervangen te worden in rechtsgeldige bedingen. Deze moeten zoveel mogelijk aansluiten bij het oorspronkelijke doel van de betreffende bepalingen en ten gunste van dan+doen+we+dat strekken.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">11.2<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Op geschillen tussen dan+doen+we+dat en jou als dan+doen+we+dat-er of jouw introduc&eacute; is uitsluitend Nederlands Recht van toepassing. Uitsluitend de Nederlandse rechter is bevoegd kennis te nemen van eventuele geschillen voortvloeiende uit deze&nbsp;<\\/span><span class=\\\"s1\\\">overeenkomst met dan+doen+we+dat.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><strong>11.3 Spelregels Organisator&nbsp;(Host)&nbsp;<\\/strong><\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">1.Alle events worden door de deelnemers zelf opgezet. Deelname aan een event is altijd voor eigen risico. dan+doen+we+dat kan op geen enkele wijze aansprakelijk worden gesteld voor eventueel ontstane schade.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">2.Het opzetten van commerci&euml;le events is niet toegestaan. Commerci&euml;le events zijn events die voor de organisator resulteren in financieel of ander (indirect) gewin.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">3.Het maximum aantal deelnemers per event bedraagt -- personen per event. Voor meer deelnemers (tussen -- en --) dien je een tweede host, organisator op te geven via het organisator paneel in het event. Alleen de dan+doen+we+dat organisatie is gerechtigd om events te organiseren voor meer dan -- personen.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">4.De maximale kosten per deelnemer mogen niet meer dan &euro; 75 bedragen. `<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">5.Events die je op de dan+doen+we+dat -site plaatst, worden geacht exclusieve dan+doen+we+dat -events te zijn. Dit betekent dat ze niet ook op andere sites mogen worden gepubliceerd waar ze toegankelijk zijn voor niet dan+doen+we+dat leden. Je kunt natuurlijk wel andere mensen op jouw event wijzen en ze uitnodigen om mee te doen aan dan+doen+we+dat.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">6.Meerdaagse events kunnen niet worden georganiseerd door deelnemers, maar alleen door dan+doen+we+dat organisaties.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">7.dan+doen+we+dat behoudt zich het recht voor om de tekst die je opgeeft bij het opzetten van een event te wijzigen, in te korten of te verwijderen indien dit passend of noodzakelijk wordt geacht.<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">8.Events die overeenkomen of conflicteren met events van de dan+doen+we+dat -organisatie kunnen zonder nadere opgaaf van redenen worden geweigerd.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p5\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">dan+doen+we+dat<\\/span><\\/p>\\r\\n<p class=\\\"p5\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">NAW<\\/span><\\/p>\",\"name\":\"core.rich-text-block\",\"nomobile\":\"1\"}',NULL),(1180,8,'container','left',553,4,'[\"[]\"]',NULL),(1186,8,'container','right',553,5,'[\"[]\"]',NULL),(1188,7,'container','left',550,4,'[\"[]\"]',NULL),(1189,7,'widget','core.rich-text-block',551,6,'{\"title\":\"\",\"adminTitle\":\"\",\"data\":\"<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><strong>Privacyreglement dan+doen+we+dat <\\/strong><\\/span><\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">dan+doen+we+dat is een betaalde online social event community. De lage lidmaatschap-kosten die onze leden betalen vormen ons verdienmodel. Wij werken niet met commercials en wij delen nooit data van (potenti&euml;le) leden met derden. In ons Privacyreglement gebruiken wij een aantal definities (deze definities kunnen in enkelvoud en meervoud worden gebruikt): <\\/span><\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Cookie: een klein bestand dat via een internetsite op (het IP-adres van) jouw computer wordt geplaatst en informatie over jouw bezoek aan de dan+doen+we+dat internetsite registreert; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Reglement: dit privacyreglement; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Privacywetgeving: de Algemene Verordening Gegevensbescherming. <\\/span><\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><strong>1. Toelichting op het Reglement <\\/strong><\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">dan+doen+we+dat mag de gegevens die jij aan haar verstrekt niet zonder meer verwerken. De Privacywetgeving is bedoeld om de privacy van personen te beschermen. Door deze wetgeving wordt het toegestane gebruik van jouw persoonsgegevens door anderen beperkt. Op grond van deze wet heeft dan+doen+we+dat de plicht om haar (potenti&euml;le) leden en zakelijke relaties: <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; op de hoogte te stellen van de wijze waarop en het doel waarmee gegevens door dan+doen+we+dat worden verwerkt; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; te melden wie de gegevens kunnen inzien; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; voor het verwerken van bepaalde gegevens toestemming te vragen. <\\/span><\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">dan+doen+we+dat vindt jouw privacy belangrijk. Daarom geeft dan+doen+we+dat in dit Reglement een toelichting op hoe zij met jouw gegevens omgaat, wat het doel is van het gebruik daarvan en voor de verwerking van welke gegevens dan+doen+we+dat expliciet om jouw toestemming moet vragen. <\\/span><\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><strong>2. De persoonsgegevens die dan+doen+we+dat gebruikt en het doel van het gebruik <\\/strong><\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">dan+doen+we+dat verwerkt (mogelijk) jouw persoonsgegevens als je lid wordt of bent van dan+doen+we+dat of als je via het contactformulier contact met ons opneemt. Leden van dan+doen+we+dat maken zelf een profiel aan en op dit profiel is de gebruikersnaam, foto, leeftijd, en geslacht te zien is. Leden kunnen ervoor kiezen om hun telefoonnummer met andere leden te delen. dan+doen+we+dat verzamelt qua persoonsgegevens jouw naam, e-mailadres, geboortedatum, foto en IBAN-nummer. De hiervoor genoemde persoonsgegevens zijn uiteraard niet te zien voor andere leden en\\/of derden. Indien je zakelijke relatie bent van dan+doen+we+dat worden mogelijk jouw naam, e-mailadres en telefoonnummer verwerkt. Deze gegevens stellen ons in staat om: <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; de overeenkomst die leden en zakelijke relaties met dan+doen+we+dat sluiten financieel en administratief te kunnen afhandelen; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; onze dienstverlening te kunnen leveren; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; leden, zakelijke relaties of ge&iuml;nteresseerden te kunnen bereiken als dat nodig is; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; om onze dienstverlening verder te ontwikkelen\\/te optimaliseren; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; jou op maat gesneden informatie aan te bieden (nieuwsbrief). <\\/span><\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">IP-adressen\\/cookies <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">dan+doen+we+dat houdt IP-adressen bij van (potenti&euml;le) leden of zakelijke relaties die de website bezoeken. Deze gegevens stellen ons in staat om: <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; te registreren welke internetsite\\/internetpagina&rsquo;s je bezoekt; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; de functionaliteit en de inhoud van de website te verbeteren; <\\/span><\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; bij te houden voor welke onderwerpen of toepassingen (potenti&euml;le) leden of zakelijke relaties zich interesseren; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; ervoor te zorgen dat je niet steeds dezelfde informatie ontvangt; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; het productaanbod te verbeteren. <\\/span><\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Toelichting met betrekking tot het plaatsen van cookies <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Als je onze website bezoekt worden er automatisch cookies geplaatst waardoor we aan de hand van jouw IP-adres bepaalde informatie kunnen bijhouden. Hierbij gaat het bijvoorbeeld om informatie over hoe vaak je onze website bezoekt en voor welke onderwerpen jij je interesseert. Zie voor meer informatie ons cookiebeleid op de website. <\\/span><\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><strong>3. Verstrekking persoonsgegevens aan derden <\\/strong><\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">dan+doen+we+dat verstrekt geen persoonsgegevens aan personen of bedrijven buiten de dan+doen+we+dat-organisatie, tenzij: <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; dat verplicht is door een wettelijk voorschrift; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; dat noodzakelijk is voor het uitvoeren van een overeenkomst die dan+doen+we+dat met jou heeft gesloten; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; je daarvoor toestemming hebt gegeven. <\\/span><\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><strong>4. Plichten\\/beveiligde toegang\\/geheimhouding\\/bewaartermijn<\\/strong><\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; dan+doen+we+dat verwerkt jouw persoonsgegevens uitsluitend overeenkomstig de wet. Dit houdt (onder meer) in dat de gegevens alleen worden verwerkt voor het doel waarvoor ze verkregen worden en op een behoorlijke\\/zorgvuldige wijze overeenkomstig de wet en dit Reglement. <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; jouw persoonsgegevens kunnen enkel en alleen door personen werkzaam voor dan+doen+we+dat worden ingezien, tenzij in dit Reglement anders is bepaald. Al jouw persoonsgegevens worden door dan+doen+we+dat beveiligd tegen onbevoegde toegang. De beveiliging bestaat: <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; uit het hebben van een persoonlijk wachtwoord voor iedere persoon werkzaam voor dan+doen+we+dat om in te loggen in het digitale systeem. <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; de personen werkzaam voor dan+doen+we+dat hebben een geheimhoudingsplicht ten aanzien van alle aan dan+doen+we+dat verstrekte persoonsgegevens; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; dan+doen+we+dat heeft technische maatregelen genomen om het door haar gebruikte systeem te beveiligen tegen inbreuken van buitenaf overeenkomstig de wet; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; jouw persoonsgegevens worden niet langer bewaard dan noodzakelijk is voor een goede administratie en\\/of andere vastgestelde doelen. dan+doen+we+dat hanteert een termijn van twee jaar nadat jij inactief of geen lid meer bent, waarna de gegevens vernietigd worden. Voor zakelijke relaties geldt dat de persoonsgegevens zo lang als nodig voor een goede bedrijfsvoering worden bewaard, met inachtneming van een redelijke termijn. De wet kan een andere bewaartermijn voorschrijven. Als dat zo is zal dan+doen+we+dat zich aan de voorgeschreven wettelijke bewaartermijn houden. <\\/span><\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\"><strong>5. Jouw rechten als betrokkene <\\/strong><\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; recht op informatie: het recht om te weten of en welke persoonsgegevens van jou verwerkt worden en met welk doel; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; inzagerecht: het recht op inzage en afschrift van die gegevens voor zover de privacy van een ander daardoor niet wordt geschaad; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; het recht op correctie, aanvulling of verwijdering van gegevens indien dat nodig mocht zijn (recht op correctie en verwijdering). Aan het recht om (gedeeltelijke) verwijdering van jouw gegevens te vragen, kan alleen tegemoet gekomen worden als het bewaren van de gegevens voor een ander niet van aanmerkelijk belang is en de gegevens niet op grond van een wettelijke regeling bewaard dienen te blijven; <\\/span><\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; het recht van verzet: het recht om je in bepaalde gevallen tegen de verwerking van jouw gegevens te verzetten; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; het recht op data-portabiliteit: het recht om de persoonsgegevens die van jou bewaard worden te ontvangen om over te kunnen dragen naar een andere organisatie; <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">&bull; het recht op een menselijke blik bij geautomatiseerde besluiten. Bij een geautomatiseerd besluit is er het recht om de beslissing te laten nemen door menselijke tussenkomst. <\\/span><\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Als je gebruik wilt maken van jouw rechten, dan kun je dit per email bij info@dan+doen+we+dat.com aangeven. Als jouw verzoek wordt afgewezen wordt aan jou uitgelegd waarom. Een reden kan zijn dat jouw dossier informatie bevat die van belang is of kan zijn voor anderen. Je ontvangt binnen &eacute;&eacute;n maand na ontvangst van jouw verzoek bericht van dan+doen+we+dat. <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Ook als je een klacht hebt over de wijze van verwerking van jouw persoonsgegevens kun je contact met dan+doen+we+dat opnemen,&nbsp; dan+doen+we+dat probeert er samen met jou uit te komen. <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Heb je een (andere) opmerking\\/vraag\\/suggestie of wil je bezwaar maken tegen de nieuwsbrief door dan+doen+we+dat? Ook daarvoor kunt je schriftelijk contact met ons opnemen. <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Uiteraard zal dan+doen+we+dat ook met de in dit verband verstrekte persoonsgegevens vertrouwelijk en zorgvuldig omgaan. <\\/span><\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Onze actuele contactgegevens zijn te vinden op de website van dan+doen+we+dat. <\\/span><\\/p>\\r\\n<p class=\\\"p2\\\" style=\\\"text-align: justify;\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p1\\\" style=\\\"text-align: justify;\\\"><span class=\\\"s1\\\">Privacyreglement dan+doen+we+dat versie maart 2020 <\\/span><\\/p>\",\"name\":\"core.rich-text-block\",\"nomobile\":\"0\"}',NULL),(1190,7,'container','right',550,5,'[\"[]\"]',NULL),(1191,45,'widget','core.banner',800,8,'{\"name\":\"core.banner\",\"banner_id\":\"11\",\"title\":\"\",\"nomobile\":\"0\"}',NULL),(1193,7,'widget','sesgdpr.cookies-privacy-consent',551,7,'[]',NULL),(1194,75,'container','main',NULL,1,NULL,NULL),(1195,75,'container','middle',1194,2,NULL,NULL),(1196,75,'widget','sesgdpr.privacy-center',1195,1,NULL,NULL),(1197,1,'widget','sespwa.header',100,20,NULL,NULL),(1198,3,'container','top',NULL,1,'[\"[]\"]',NULL),(1199,3,'container','main',NULL,2,'[\"[]\"]',NULL),(1200,3,'container','middle',1198,6,'[\"[]\"]',NULL),(1201,3,'container','middle',1199,6,'[\"[]\"]',NULL),(1202,3,'widget','sespwa.banner-slideshow',1200,3,'{\"banner_id\":\"1\",\"full_width\":\"1\",\"height\":\"600\",\"title\":\"\",\"nomobile\":\"0\",\"name\":\"sespwa.banner-slideshow\"}',NULL),(1203,3,'widget','sespwa.login-or-signup',1201,6,'[\"[]\"]',NULL),(1204,3,'widget','sespwa.startup',1201,7,'{\"title\":\"\",\"copyright\":\"1\",\"logo\":\"public\\/core_file\\/22\\/01\\/bad931fa4c856119b6831a83b16ce597.png\",\"nomobile\":\"0\",\"name\":\"sespwa.startup\"}',NULL),(1205,76,'container','main',NULL,2,'[\"[]\"]',NULL),(1206,76,'container','middle',1205,6,'[\"[]\"]',NULL),(1207,76,'container','left',1205,4,'[\"[]\"]',NULL),(1208,76,'container','right',1205,5,'[\"[]\"]',NULL),(1210,76,'widget','user.list-online',1207,4,'{\"title\":\"%d Members Online\"}',NULL),(1211,76,'widget','user.list-popular',1208,9,'{\"title\":\"Popular Members\"}',NULL),(1212,76,'widget','user.home-photo',1207,3,'[\"[]\"]',NULL),(1213,76,'widget','user.list-signups',1208,8,'{\"title\":\"Recent Signups\"}',NULL),(1215,4,'widget','sesevent.calender',412,8,'{\"viewmore\":\"1\",\"loadData\":\"nextprev\",\"title\":\"\",\"nomobile\":\"0\",\"name\":\"sesevent.calender\"}',NULL),(1221,77,'container','main',NULL,2,'[\"[]\"]',NULL),(1222,77,'container','middle',1221,6,'[\"[]\"]',NULL),(1223,77,'container','left',1221,4,'[\"[]\"]',NULL),(1224,77,'container','right',1221,5,'[\"[]\"]',NULL),(1225,77,'widget','core.rich-text-block',1222,4,'{\"title\":\"\",\"adminTitle\":\"\",\"data\":\"<p class=\\\"p1\\\"><strong><span class=\\\"s1\\\">Cookieverklaring<\\/span><\\/strong><\\/p>\\r\\n<p class=\\\"p2\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\"><span class=\\\"s1\\\">Wat is een cookie?<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\"><span class=\\\"s1\\\">We maken op onze website gebruik van cookies. Een cookie is een eenvoudig klein bestandje dat met pagina&rsquo;s van deze website wordt meegestuurd en door jouw browser op de harde schrijf van jouw computer wordt opgeslagen. De daarin opgeslagen informatie kan bij een volgend bezoek weer naar onze servers teruggestuurd worden.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\"><span class=\\\"s1\\\">Functionele cookies<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\"><span class=\\\"s1\\\">Met behulp van een functionele cookie kunnen wij jou herkennen bij een herhaald bezoek op onze website. De website kan daardoor speciaal op jouw voorkeuren worden ingesteld. Ook wanneer je toestemming hebt gegeven voor het plaatsen van cookies kunnen wij dit door middel van een cookie onthouden. Op deze manier hoef je niet steeds jouw voorkeuren te herhalen waardoor je dus tijd bespaart en prettiger gebruik van onze website kunt maken. Functionele cookies kunnen verwijderd worden via de instellingen van jouw browser.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\"><span class=\\\"s1\\\">Analytische cookies<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\"><span class=\\\"s1\\\">Analytische cookies worden gebruikt om te kunnen zien welke onderdelen van de website je met dit bezoek hebt bekeken. Op deze manier kunnen we onze dienst(en) zoveel mogelijk aanpassen op het surfgedrag van onze bezoekers. Deze cookies worden automatisch verwijderd zodra je jouw webbrowser afsluit.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\"><span class=\\\"s1\\\">Google Analytics<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\"><span class=\\\"s1\\\">We gebruiken de &lsquo;&rsquo;Analytics&rsquo;&rsquo; dienst van het Amerikaanse bedrijf Google. Via onze website wordt een cookie geplaatst van Google. Op deze manier kunnen we bijhouden en rapportages krijgen over hoe bezoekers de website gebruiken. Google kan deze informatie aan derden verschaffen indien Google hiertoe wettelijk wordt verplicht, of voor zover derden de informatie namens Google verwerken. Wij hebben hier geen invloed op. Wij hebben Google niet toegestaan de verkregen analytics informatie te gebruiken voor andere Google diensten.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\"><span class=\\\"s1\\\">Google anonimiseert de verzamelde informatie zo veel mogelijk. Jouw IP-adres wordt niet meegegeven. De informatie wordt overgebracht naar en door Google opgeslagen op servers in de Verenigde Staten. Google stelt zich te houden aan de Privacy Shield principles en is aangesloten bij het Privacy Shield-programma van het Amerikaanse Ministerie van Handel. Op deze manier is er sprake van een passend beschermingsniveau voor de verwerking van eventuele persoonsgegevens.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\"><span class=\\\"s1\\\">Sociale netwerken<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\"><span class=\\\"s1\\\">We hebben op onze website buttons opgenomen om webpagina&rsquo;s te kunnen promoten (&ldquo;liken&rdquo;) of delen (&ldquo;tweeten&rdquo;) op sociale netwerken als Facebook en Twitter. De buttons werken door middel van stukjes code die van Facebook respectievelijk Twitter zelf afkomstig zijn. Met deze code worden cookies geplaatst. Wij hebben daar geen invloed op. Lees de privacyverklaring van Facebook respectievelijk van Twitter (welke regelmatig kunnen wijzigen) om te lezen wat zij met jouw (persoons)gegevens doen die zij via deze cookies verwerken.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\"><span class=\\\"s1\\\">Deze partijen anonimiseren de verzamelde informatie zo veel mogelijk. De informatie wordt overgebracht naar en door Twitter, Facebook, Google + en LinkedIn opgeslagen op servers in de Verenigde Staten. LinkedIn, Twitter, Facebook en Google + stellen zich te houden aan de Privacy Shield principes en zijn aangesloten bij het Privacy Shield-programma van het Amerikaanse Ministerie van Handel. Op deze manier is er sprake van een passend beschermingsniveau voor de verwerking van eventuele persoonsgegevens.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\"><span class=\\\"s1\\\">Recht op inzage en correctie of verwijdering van jouw gegevens<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\"><span class=\\\"s1\\\">Jij hebt het recht om te vragen om inzage in en correctie of verwijdering van jouw gegevens. Onze contactgegevens vind je op onze contactpagina. We kunnen je vragen om je te identificeren, dit doen we om misbruik te voorkomen. Wanneer je inzage wilt in persoonsgegevens gekoppeld aan een cookie, vragen wij je een kopie van de cookie in kwestie mee te sturen. Je kunt deze terugvinden in de instellingen van jouw browser.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p3\\\"><span class=\\\"s1\\\">In- en uitschakelen van cookies en verwijdering daarvan<\\/span><\\/p>\\r\\n<p class=\\\"p3\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\"><span class=\\\"s1\\\">Meer informatie omtrent het in- en uitschakelen en het verwijderen van cookies kun je vinden in de instructies en\\/of met behulp van de Help-functie van jouw browser.<\\/span><\\/p>\\r\\n<p class=\\\"p4\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p4\\\">&nbsp;<\\/p>\\r\\n<p class=\\\"p5\\\"><span class=\\\"s1\\\">MEER INFORMATIE OVER COOKIES?<\\/span><\\/p>\\r\\n<p class=\\\"p5\\\"><span class=\\\"s1\\\">Hier komt een link naar bijvoorbeeld privacyzeker.punt.nl<\\/span><\\/p>\",\"name\":\"core.rich-text-block\",\"nomobile\":\"0\"}',NULL),(1226,77,'widget','core.layout-column-width',1224,6,'{\"title\":\"\",\"columnWidth\":\"\",\"columnWidthType\":\"px\",\"nomobile\":\"0\",\"name\":\"core.layout-column-width\"}',NULL),(1227,78,'container','top',NULL,1,NULL,NULL),(1228,78,'container','main',NULL,2,NULL,NULL),(1229,78,'container','middle',1227,1,NULL,NULL),(1230,78,'container','middle',1228,2,NULL,NULL),(1231,78,'container','left',1228,1,NULL,NULL),(1232,78,'widget','sesadvancedactivity.feed',1230,1,NULL,NULL),(1233,78,'widget','sesadvancedactivity.onthisday-banner',1230,1,NULL,NULL),(1234,78,'widget','user.home-links',1231,1,NULL,NULL),(1235,78,'widget','core.statistics',1231,2,NULL,NULL),(1236,79,'container','main',NULL,2,NULL,NULL),(1237,79,'container','middle',1236,2,NULL,NULL),(1238,79,'widget','sesadvancedactivity.welcometab-sections',1237,1,'{\"title\":\"\",\"displaysections\":\"4\",\"nomobile\":\"0\",\"name\":\"sesadvancedactivity.welcometab-sections\"}',NULL),(1239,79,'widget','sesbasic.simple-html-block',1237,2,'{\"bodysimple\":\"<div class=\\\"sesact_welcome_txt_block sesbasic_clearfix\\\">\\r\\n  <p class=\\\"sesact_welcome_txt_block_des\\\">Welcome to the new feeds. You can now share your files, sell products, upload multiple photos, videos & much more. Schedule post to be shared at a later date and choose targeted audience for your posts. So, start sharing!!<\\/p>\\r\\n\\t<p class=\\\"sesact_welcome_txt_block_img\\\">\\r\\n\\t\\t<img src=\\\"application\\/modules\\/Sesadvancedactivity\\/externals\\/images\\/welcome.png\\\" alt=\\\"\\\" \\/>\\r\\n\\t<\\/p>\\r\\n<\\/div>\",\"show_content\":\"1\",\"title\":\"\",\"nomobile\":\"0\